// alphaConVelocidad.js
var AlphaConVelocidad = pc.createScript('alphaConVelocidad');

AlphaConVelocidad.attributes.add('tiempoEspera', {type: 'number', default:0,title: 'tiempoEspera'});
AlphaConVelocidad.attributes.add('duracionIn', {type: 'number', default:0,title: 'duracionIn'});
AlphaConVelocidad.attributes.add('duracionOut', {type: 'number', default:0,title: 'duracionOut'});
AlphaConVelocidad.attributes.add('hijos', {type: 'entity', array:true});

AlphaConVelocidad.prototype.initialize = function() {
    
   
};

// update code called every frame
AlphaConVelocidad.prototype.update = function(dt) {
    
   
};

AlphaConVelocidad.prototype.fadeIn = function(callBack) {
    
   var p = { x: 0 };     
     for(var i = 0; i < this.hijos.length;i++)
     {
            if(this.hijos[i].element != null)
                this.hijos[i].element.opacity = 0;
             else
             {
                 this.hijos[i].model.material.opacity = 0;
                 this.hijos[i].model.material.update();
             }
     }
      
    if(this.entity.element != null)
        this.entity.element.opacity = 0;
    else
    {
        this.entity.model.material.opacity = 0;
        this.entity.model.material.update();
    }
    this.hiloDisco = this.app.tween(p).to({x:1 }, this.duracionIn, pc.SineOut).on('complete',function ()
    {       
        if(callBack != null)
            callBack();
        
    }.bind(this)).on('update',function() {               
         
         if(this.entity.element != null)
            this.entity.element.opacity = p.x;
         else
         {
            this.entity.model.material.opacity = p.x;
            this.entity.model.material.update();
         }
         for(var i = 0; i < this.hijos.length;i++)
         {
             if(this.hijos[i].element != null)
                this.hijos[i].element.opacity = p.x;
             else
             {
                 this.hijos[i].model.material.opacity = p.x;
                 this.hijos[i].model.material.update();
             }
         }
    }.bind(this)).delay(this.tiempoEspera).start();
    
    
};
AlphaConVelocidad.prototype.fadeOut = function(callBack) {
    
   var p = { x: 1 };     
     for(var i = 0; i < this.hijos.length;i++)
     {
            if(this.hijos[i].element != null)
                this.hijos[i].element.opacity = 1;
             else
             {
                 this.hijos[i].model.material.opacity = 1;
                 this.hijos[i].model.material.update();
             }
     }
    if(this.entity.element != null)
        this.entity.element.opacity = 1;
    else
    {
        this.entity.model.material.opacity = 1;
        this.entity.model.material.update();
    }
        
    this.hiloDisco = this.app.tween(p).to({x:0 }, this.duracionIn, pc.SineOut).on('complete',function ()
    {       
        if(callBack != null)
            callBack();
        
    }.bind(this)).on('update',function() {               
        if(this.entity.element != null)
            this.entity.element.opacity = p.x;
        else
        {
            this.entity.model.material.opacity = p.x;
            this.entity.model.material.update();
        }
         for(var i = 0; i < this.hijos.length;i++)
         {
              if(this.hijos[i].element != null)
                this.hijos[i].element.opacity = p.x;
             else
             {
                 this.hijos[i].model.material.opacity = p.x;
                 this.hijos[i].model.material.update();
             }
         }
    }.bind(this)).start();
    
    
};

