// animaAlfa3d.js
var AnimaAlfa3d = pc.createScript('animaAlfa3d');
AnimaAlfa3d.attributes.add('material', { type: 'asset', assetType: 'material', array: false });
AnimaAlfa3d.attributes.add('speed', {type: 'number', default:0.01,title: 'speed'});
AnimaAlfa3d.attributes.add('desde', {type: 'number', default:0,title: 'desde'});
AnimaAlfa3d.attributes.add('hasta', {type: 'number', default:1,title: 'hasta'});
AnimaAlfa3d.attributes.add('delay', {type: 'number', default:0,title: 'delay'});
AnimaAlfa3d.attributes.add('loop', {type: 'number', default:1,title: 'LOOP'});
AnimaAlfa3d.attributes.add('apagaAlTerminar', {type: 'number', default:1,title: 'apagaAlTerminar'});
AnimaAlfa3d.attributes.add('tipoMaterial', {type: 'string', default:"opacity",title: 'opacity'});
AnimaAlfa3d.attributes.add('finAnim', {type: 'number', default:1,title: 'finAnim'});

// initialize code called once per entity
AnimaAlfa3d.prototype.initialize = function() {
    
    this.sentido = 0;
    this.contadorDelay = 0;
    this.materialCargado = this.material.resource;
    if(this.desde < this.hasta)
        this.sentido = 1;
    else
        this.sentido = -1;
    this.resetMaterial();
    //this.empiezaAnim(0,1);
    ////console.log(this.materialCargado);
};
AnimaAlfa3d.prototype.empiezaAnim = function(desde,hasta,delay,speed)
{
    this.entity.enabled = true;
    this.desde = desde;
    this.hasta = hasta;
    if(delay != null)
        this.delay = delay;
    if(speed != null)
        this.speed = speed;
    
     if(this.desde < this.hasta)
        this.sentido = 1;
    else
        this.sentido = -1;
    this.contadorDelay = 0;
    this.resetMaterial();
    this.finAnim = 0;
};
AnimaAlfa3d.prototype.resetMaterial = function(eje) {
    
        this.materialCargado[this.tipoMaterial] = this.desde;    
        this.materialCargado.update();   
   
};

// update code called every frame
AnimaAlfa3d.prototype.update = function(dt) {    
    
    if(this.finAnim == 1)
        return;
    
    if(this.contadorDelay < this.delay)
    {
        this.contadorDelay =  this.contadorDelay + dt;
        return;
    }
    
    var alfa = this.materialCargado.opacity;  
    var delta;
    var iteracionFinal = false;
    if(this.sentido == -1)        
        delta = alfa - dt*this.speed;
    else
        delta = alfa + dt*this.speed;
    if(delta <= 0)
    {
        iteracionFinal = true;
        delta = 0;
    }
    else if(delta >= 1)
    {
        iteracionFinal = true;
        delta = 1;
    }        
   
    this.materialCargado[this.tipoMaterial] = delta;
    this.materialCargado.update();
    
    if(iteracionFinal)
    {
        if(this.loop == 1)
        {
            this.empiezaAnim(this.desde,this.hasta);  
        }
        else
        {
            //this.finAnim = 1;
            //setTimeout(this.apagaObjeto.bind(this),0.1);
        }
    }
   
   
};
AnimaAlfa3d.prototype.apagaObjeto = function() {    
  if(this.finAnim == 1)  
      this.entity.enabled = false;  
};
AnimaAlfa3d.prototype.terminaAnim = function() {    
   this.finAnim = 1;
};


