// animaTexturas.js
var AnimaTexturas = pc.createScript('animaTexturas');
AnimaTexturas.attributes.add("texturas", {type: "asset", assetType: "texture", array: true, title: "texturas"});
AnimaTexturas.attributes.add('material', { type: 'asset', assetType: 'material', array: false });
AnimaTexturas.attributes.add('loop', {type: 'number', default:0,title: 'loop'});
AnimaTexturas.attributes.add('autoAnim', {type: 'number', default:0,title: 'autoAnim'});
AnimaTexturas.attributes.add('texture3D', {type: 'number', default:0,title: 'texture3D'});
AnimaTexturas.attributes.add('frames', {type: 'number', default:60,title: 'frames'});

// initialize code called once per entity
AnimaTexturas.prototype.initialize = function() {
    
    var anim = this.entity;    
    var array = [this.entity,this.texturas,0,this.texturas.length,false,0,0,0,false];
    this.cont = 0;
    this.arrayAnimaciones = [];
    this.arrayAnimaciones[0] = array;   
    this.callBack = null;
    
    //is.arrayAnimaciones[0][4] = true;   
    if(this.autoAnim == 1)
    {        
        if(this.loop == 1)
            this.arrayAnimaciones[0][8] = true;
        this.arrayAnimaciones[0][4] = true; 
    }
};
AnimaTexturas.prototype.inicioAnim = function(callBack,desde,hasta)
{  
     this.callBack = callBack;
     this.cont = 0;
     var array = [this.entity,this.texturas,0,this.texturas.length,false,0,0,0,false];
     this.cont = 0;         
     if(desde != null && hasta != null)
     {
        this.arrayAnimaciones[0][2] = desde;
        this.arrayAnimaciones[0][3] = hasta;    
     }
     else
     {
        var array = [this.entity,this.texturas,0,this.texturas.length,false,0,0,0,false];       
        this.arrayAnimaciones = [];
        this.arrayAnimaciones[0] = array;   
     }
     this.cont = 0;  
     if(this.texture3D == 0)
        this.entity.element.texture = this.texturas[this.arrayAnimaciones[0][2]].resource;
     else
        this.cambiaTextura3D(this.texturas[this.arrayAnimaciones[0][2]].resource);   
     this.arrayAnimaciones[0][4] = true; 
     
};
AnimaTexturas.prototype.stopAnim = function()
{
    this.arrayAnimaciones[0][4] = false;
};
// update code called every frame
AnimaTexturas.prototype.update = function(dt) {
     
    var tiempo = dt;
    var fps = 1/tiempo;
    this.cont = this.cont + tiempo;    
    var frameLimite = fps / this.frames;
    frameLimite = frameLimite / fps;
    
    if (this.cont >= frameLimite)
    {
        this.cont = 0;
        for(var i = 0; i < this.arrayAnimaciones.length;i++)
        {
           if(this.arrayAnimaciones[i][4] == true)           
           {    
               if(this.arrayAnimaciones[i][7] == 0)
               {
                    var currentFrame = this.arrayAnimaciones[i][5];
                    if(currentFrame == 0)
                        currentFrame = this.arrayAnimaciones[i][2];
                    if(this.texture3D == 0)                    
                        this.arrayAnimaciones[i][0].element.texture = this.arrayAnimaciones[i][1][currentFrame].resource;    
                    else
                         this.cambiaTextura3D(this.arrayAnimaciones[i][1][currentFrame].resource);
                   //console.log( this.arrayAnimaciones[i][1][currentFrame].resource);
                    this.arrayAnimaciones[i][5] = this.arrayAnimaciones[i][5] + 1;
                    currentFrame = this.arrayAnimaciones[i][5];
                    if(currentFrame == this.arrayAnimaciones[i][3])
                    {
                        if(this.arrayAnimaciones[i][6]  == 0)      
                        {
                            if( this.arrayAnimaciones[i][8])
                                 this.arrayAnimaciones[i][5] = 1;
                            else
                            {
                                this.arrayAnimaciones[i][4] = false;   
                                this.arrayAnimaciones[i][5] = 0;
                                if(this.callBack != null)
                                    this.callBack();

                            }
                        }
                        else if(this.arrayAnimaciones[i][6]  == 2)      
                        {
                            this.arrayAnimaciones[i][7] = 1;
                        }                    
                    }               
               }           
               if(this.arrayAnimaciones[i][7] == 1)
               {
                    var currentFrame = this.arrayAnimaciones[i][5];
                    if(currentFrame == this.arrayAnimaciones[i][3])
                    {
                        currentFrame = this.arrayAnimaciones[i][3] - 2;
                        this.arrayAnimaciones[i][5] = currentFrame;
                    }
                    if(this.texture3D == 0)       
                        this.arrayAnimaciones[i][0].element.texture = this.arrayAnimaciones[i][1][currentFrame].resource;           
                    else
                        this.cambiaTextura3D(this.arrayAnimaciones[i][1][currentFrame].resource);
                    this.arrayAnimaciones[i][5] = this.arrayAnimaciones[i][5] - 1;             
                    currentFrame = this.arrayAnimaciones[i][5];
                    if(currentFrame == this.arrayAnimaciones[i][2]-1)
                    {                   
                        this.arrayAnimaciones[i][4] = false;   
                        this.arrayAnimaciones[i][5] = 0;

                        if(this.arrayAnimaciones[i][6]  == 2)                         
                            this.arrayAnimaciones[i][7] = 0;                                  
                    }               
               }           
           }
        }
    }
};
AnimaTexturas.prototype.cambiaTextura3D = function(textura)
{
   if(this.material != null)
   {
       this.material.resource.diffuseMap = textura;
       this.material.resource.emissiveMap = textura;
       this.material.resource.opacityMap = textura;
       this.material.resource.update();
       return;
   }
   var meshInstances = this.entity.model.meshInstances;
    for (var i = 0; i < meshInstances.length; ++i) { 
        var mesh = meshInstances[i];
        mesh.material.diffuseMap = textura;
        mesh.material.opacityMap = textura;
        mesh.material.update();
    }  
};



// animaUvsPlus.js
var AnimaUvsPlus = pc.createScript('animaUvsPlus');
AnimaUvsPlus.attributes.add('material', { type: 'asset', assetType: 'material', array: false });
AnimaUvsPlus.attributes.add('speed', {type: 'number', default:0.01,title: 'speed'});
AnimaUvsPlus.attributes.add('eje', {type: 'number', default:0,title: 'ejeX_o_Y'});
AnimaUvsPlus.attributes.add('loop', {type: 'number', default:1,title: 'LOOP'});
AnimaUvsPlus.attributes.add('desde', {type: 'number', default:0,title: 'desde'});
AnimaUvsPlus.attributes.add('hasta', {type: 'number', default:1,title: 'hasta'});
AnimaUvsPlus.attributes.add('tipoMaterial', {type: 'string',array:true,title: 'opacityMapOffset'});


// initialize code called once per entity
AnimaUvsPlus.prototype.initialize = function() {
      
    this.materialCargado = this.material.resource;
    ////console.log(this.materialCargado);
};
AnimaUvsPlus.prototype.resetMaterial = function(eje) {
    
    for(var i = 0; i < this.tipoMaterial.length;i++)
        this.materialCargado[this.tipoMaterial[i]] = new pc.Vec2(0,0);    
    this.materialCargado.update();  
    this.entity.enabled = true;  
    this.eje = eje;
   
};
AnimaUvsPlus.prototype.play =  function(desde,hasta,eje)
{    
    this.desde = desde;
    this.hasta= hasta;
    this.resetMaterial(eje);
    
    
};
// update code called every frame
AnimaUvsPlus.prototype.update = function(dt) {    
    
   //X es 1 y es 0 ejes
   
    for(var i = 0; i < this.tipoMaterial.length; i++)
    {
        var vector;
        switch(this.tipoMaterial[i])
        {
            case  "opacityMapOffset":
                 vector =  this.materialCargado.opacityMapOffset;  
            break;
            case "diffuseMapOffset":
                 vector =  this.materialCargado.diffuseMapOffset;  
            break;
            case "emissiveMapOffset":
                vector =  this.materialCargado.emissiveMapOffset;  
            break;

        }   
        if(this.eje == 0)
        {

            var valor = vector.y;
            var otroVector = vector.x;
            var delta = valor - dt*this.speed;
            if(delta < 0)
            {
                if(this.loop == 0)
                {
                    delta = 0;
                    this.eje = -99;     
                }
                else
                    delta = 1;
            }
            this.materialCargado[this.tipoMaterial[i]] = new pc.Vec2(otroVector,delta);    
            this.materialCargado.update();
        }
        else if(this.eje == 1)
        {         
            var valor = vector.x;
          
            var otroVector = vector.y;
            var delta = valor + dt*this.speed;
            if(delta > this.hasta)
            {
                if(this.loop == 0)
                {
                    delta = this.hasta;
                    this.eje = -99;  
                    setTimeout(this.apagaObjeto.bind(this),20);
                }
                else
                    delta = this.desde;
            }
            ////console.log("updateare el material " + delta);

            this.materialCargado[this.tipoMaterial[i]] = new pc.Vec2(delta,otroVector);    
            this.materialCargado.update();       

        }
    }
};
AnimaUvsPlus.prototype.apagaObjeto = function() {    
  this.entity.enabled = false;  
};


// arrowMovement.js
var ArrowMovement = pc.createScript('arrowMovement');
ArrowMovement.attributes.add('speed', {type: 'number',default:5});
ArrowMovement.attributes.add('distanceX', {type: 'number',default:22});
ArrowMovement.attributes.add('sentido', {type: 'number',default:-1});
// initialize code called once per entity
ArrowMovement.prototype.initialize = function() {
  
    this.deltaX = 0;
    this.initialPos = this.entity.getLocalPosition().clone();
};

// update code called every frame
ArrowMovement.prototype.update = function(dt) {
    
    this.deltaX = this.speed*dt;
    var pos = this.entity.getLocalPosition();
    this.entity.setLocalPosition(pos.x + this.sentido*this.deltaX,pos.y,pos.z);
    pos = this.entity.getLocalPosition();
    if(pos.x <= this.initialPos.x - this.distanceX)
    {
        this.sentido = 1;
        this.deltaX = 0;
    }
    else if(pos.x >= this.initialPos.x + this.distanceX)
    {
        this.sentido = -1;
        this.deltaX = 0;
    }
    
};

