// animaMsg.js
var AnimaMsg = pc.createScript('animaMsg');
AnimaMsg.attributes.add('destinox', {type: 'number', default:0,title: 'destinox'});
AnimaMsg.attributes.add('destinoy', {type: 'number', default:0,title: 'destinoy'});
AnimaMsg.attributes.add('destinoz', {type: 'number', default:0,title: 'destinoz'});
AnimaMsg.attributes.add('tiempo', {type: 'number', default:0.6,title: 'tiempo'});
AnimaMsg.attributes.add('delaySaca', {type: 'number', default:1.8,title: 'delaySaca'});
AnimaMsg.attributes.add('traducir', {type: 'number', default:1,title: 'traducir'});
AnimaMsg.attributes.add('esconder', {type: 'number', default:0,title: 'esconder'});
AnimaMsg.attributes.add("boton", {type: "asset", assetType: "texture", array: true, title: "boton"});
AnimaMsg.attributes.add('tipoTween', {type: 'string', default:"BounceOut",title: 'tipoTween'});
// initialize code called once per entity
AnimaMsg.prototype.initialize = function() {
    this.tween = null;  
     this.mc = this.entity;
    var origen = this.entity.getLocalPosition();
    this.origen =  new pc.Vec3(origen.x,origen.y,origen.z);    
    this.destino = new pc.Vec3(this.destinox,this.destinoy,this.destinoz);
    switch(this.tipoTween)
    {
        case "BounceOut":
            this.tipoTween = pc.BounceOut;
        break;
         case "SineIn":
            this.tipoTween = pc.SineIn;
        break;
         case "SineOut":
            this.tipoTween = pc.SineOut;
        break;
         case "SineInOut":
            this.tipoTween = pc.SineInOut;
        break;
            
    }
    
    
    
    if(this.boton.length == 3 && this.traducir == 1)
        this.traduce(0);
    
    if(this.esconder == 1)
        this.entity.enabled = false;
    
   
    
};
