    if(cambiar != null)    
        this.entity.element.texture = this.boton[textIndex].resource;  
    else
    {    
        this.entity.element.texture = this.boton[1].resource;   
        setTimeout(this.restauraBoton.bind(this,callBack),180); 
    }
    
