// ball2dRot.js
var Ball2dRot = pc.createScript('ball2dRot');
Ball2dRot.attributes.add('radius', {type: 'number',default:0.19, title: 'ball radius'});
Ball2dRot.attributes.add('fakeEntity', {type: 'entity', title: 'fake entity for aux quat'});
Ball2dRot.attributes.add('axes', {
    type: 'number',
    enum: [
        { 'XY': 1 },
        { 'XZ': 2 },
        { 'YZ': 3 }
    ],
    default: 1,
    title: 'Axes',
    description: 'The axes for fake 3d rotate'
});

Ball2dRot.prototype.initialize = function() 
{       
    //this.body = this.entity.script.follower.follow.script.p2Body.body;
    if(this.fakeEntity == null)
        this.fakeEntity = this.app.root.findByName("fakeEntity");
    this.lastPosition = this.entity.getPosition().clone();
};


Ball2dRot.prototype.rotateBall = function()
{
    var radius = this.radius;
    if (radius == 0) 
    {
        // can't rotate ball
        return; 
    }

    // distance the ball traveled between the last Update and this one
    // we subtract the vectors in this order to use it as a direction vector later
    var entityPos = this.entity.getPosition().clone();
    var currentToLast = new pc.Vec3();       
    currentToLast.sub2(this.lastPosition,entityPos);

    // segment length that the ball rolled along its surface
    var segment = currentToLast.length();

    if (segment == 0) 
    {
        // no distance travelled, nothing to do
        return;
    }
    if(segment > 0.01)
        segment = 0.01;
    /*var x1 = 0.001;
        var y1 = this.radius;
        var x2 = 0.05;
        var y2 = 3;

        if(radius > 3)
            radius = 3;
        var M = (y2-y1)/(x2-x1);
        var Y = M*(segment - x1) + y1;
        radius = Y;*/


    //console.log("segment " + segment);
    // to build a Quaternion to hold the desired rotation, 
    // we need a Vector3 "axis" and an angle "theta"
    // first, the axis:

    // define the down direction vector for the ball
    // the ball rolls in the x and y directions,
    // and positive z points to the ground
    // Important: 	this is DIFFERENT from Vector3.down because Vector3 assumes 
    //				a 3D world space where negative y is down
    var ballDown;
    switch (this.axes)
    {
        case 1: //XY
            ballDown = new pc.Vec3(0, 0, -30); 
            break;
        case 2: //XZ
            ballDown = new pc.Vec3(0, -50, 0); 
            break;
        case 3: //YZ 
            ballDown = new pc.Vec3(-30, 0, 0); 
            break;
    }	

    // use Cross Product to find the axis of rotation 
    // https://www.mathsisfun.com/algebra/vectors-cross-product.html
    var axis = new pc.Vec3().cross(ballDown, currentToLast);


    // Cross Product will fail if both vectors are parallel or perpendicular
    if (axis == pc.Vec3.ZERO)
    {
        // this should never happen because currentToLast.z is always 0
        // but who knows where this code will be copy-pasted to...
        return;
    }

    // next, the angle theta:

    // arc length formula
    // s = r * theta
    // theta = s / r
    // http://www.mathopenref.com/arclength.html
    var  theta = segment / this.radius; // in radians

    var  thetaDegrees = theta * 180 / Math.PI;

    //console.log("angulo  " + thetaDegrees);	// create the rotation Quaternion
    var q = new pc.Quat();
    q.setFromAxisAngle(axis,thetaDegrees);	

    //console.log(q);

    // apply rotation to the transform
    // q must come first in multiplication order!!!
    // Quaternion multiplication is Non-Commutative!
    var quatRot = new pc.Quat();
    quatRot.mul2(q,this.entity.getRotation());       
    this.fakeEntity.setRotation(quatRot);		
    this.entity.setLocalEulerAngles(this.fakeEntity.getLocalEulerAngles());
    //console.log(this.entity.getLocalEulerAngles().x);
};


Ball2dRot.prototype.update = function(dt) {
        this.rotateBall();        
        this.lastPosition = this.entity.getPosition().clone();

};



