// elementAlphaAnim.js
var ElementAlphaAnim = pc.createScript('elementAlphaAnim');
ElementAlphaAnim.attributes.add('speed', { type: 'number', default:1 });
ElementAlphaAnim.attributes.add('delayFadeIN', { type: 'number', default:1 });
ElementAlphaAnim.attributes.add('delayFadeOUT', { type: 'number', default:1 });
// initialize code called once per entity
// 

ElementAlphaAnim.prototype.initialize = function() {
    
    this.objeto = [];
    this.tipo = [];
};

ElementAlphaAnim.prototype.fadeOut = function(hijoIndex) {
   var hijo = this.entity.children[hijoIndex];
    setTimeout(function(){
        if(!this.objeto.includes(hijo))
        {
            this.objeto.push(hijo);
            this.tipo.push(-1);
        }
        else
        {
            var index = this.objeto.indexOf(hijo);
            this.tipo[index] = -1;
        }
    }.bind(this),this.delayFadeOUT*1000);
   
};
ElementAlphaAnim.prototype.fadeIn = function(hijoIndex) {
    var hijo = this.entity.children[hijoIndex];
     setTimeout(function(){
         if(!this.objeto.includes(hijo))
         {
             this.objeto.push(hijo);
             this.tipo.push(1);
         }
         else
         {
             var index = this.objeto.indexOf(hijo);
             this.tipo[index] = 1;
         }
     }.bind(this),this.delayFadeIN*1000);
};
ElementAlphaAnim.prototype.reset = function(hijoIndex,alfa) {    
    var hijo = this.entity.children[hijoIndex];
    hijo.enabled = true;
    if(!this.objeto.includes(hijo))
    {
        this.objeto.push(hijo);
        this.tipo.push(0);
    }
    else
    {
        var index = this.objeto.indexOf(hijo);
        this.tipo[index] = 0;
    }
    hijo.element.opacity = alfa;
};

// update code called every frame
ElementAlphaAnim.prototype.update = function(dt) {
    
    for(var i = 0; i < this.objeto.length; i++)
    {
        var obj = this.objeto[i];
        var tipoFade = this.tipo[i];
        var alfa = this.objeto[i].element.opacity;
        
        if(tipoFade == 1 && alfa < 1)
        {
            alfa = alfa + dt*this.speed;
            if(alfa > 1)
                alfa = 1;
            obj.element.opacity = alfa;
            
        }
        else if(tipoFade == -1 && alfa > 0)
        {
            alfa = alfa - dt*this.speed;
            if(alfa < 0)
                alfa = 0;
            obj.element.opacity = alfa;
        }
    }
};


