var Fps = pc.createScript('fps');

Fps.prototype.initialize = function () 
{
    _fps = this;
    this.fps = new FPSMeter({heat: false, graph: false});
    this.fps.hide();
    this.tiempo = 0;
    this.tiempoMax = 1.2;
    this.sumFps = 0;
    this.cantFps = 0;
    this.iniciarCalculos = false;
    this.primerIntento = true;
    this.rectificadores = 0;
    this.maxRectificadores = 1;
};

Fps.prototype.ini = function () 
{
    this.iniciarCalculos = true;
};
    // Called every frame, dt is time in seconds since last update
Fps.prototype.update = function (dt) {
   
    
    if(!this.iniciarCalculos)
        return;
    
    if(this.rectificadores == this.maxRectificadores)
        return;
    
    this.fps.tick();
    this.tiempo = this.tiempo + dt;
    if(this.tiempo < this.tiempoMax)
    {        
        this.sumFps = this.sumFps + this.fps.fps; 
        this.cantFps = this.cantFps + 1;
    }
    else
    {
       var prom = this.sumFps/this.cantFps;
       if(this.primerIntento)
       {
           console.log("el promedio de fps 1 intento fue de " + prom);       
           this.primerIntento = false;
           this.tiempoMax = 2;
       }
       else
       {           
           console.log("el promedio de fps fue de " + prom);       
           this.rectificadores = this.rectificadores + 1;
           var cal = "";
           if(prom > 45)
                cal = "alta";
           else if(prom > 33)
               cal = "media";
           else if(prom > 14)
               cal = "mediaBaja";
           else
               cal = "baja";
           
           if(calidad != cal )
           {
              calidad = cal;
              switch(calidad)
              {
                  case "alta":
                      this.app.graphicsDevice.maxPixelRatio = window.devicePixelRatio;
                  break;
                       case "media":
                       if(window.devicePixelRatio > 2)
                            this.app.graphicsDevice.maxPixelRatio = 2;
                       else if(window.devicePixelRatio > 1.5)
                           this.app.graphicsDevice.maxPixelRatio = 1.5;
                       else 
                            this.app.graphicsDevice.maxPixelRatio = 1;
                           
                  break;
                       case "mediaBaja":
                       if(window.devicePixelRatio > 2)
                           this.app.graphicsDevice.maxPixelRatio = 1;
                       else 
                           this.app.graphicsDevice.maxPixelRatio = 1;
                       
                  break;
                       case "baja":
                      this.app.graphicsDevice.maxPixelRatio = 0.5; //window.devicePixelRatio/2;
                  break;
              }
              
           }
           
          //alert("seteando calidad que es " + calidad);
          
       }       
       this.sumFps = 0;
       this.tiempo = 0;
       this.cantFps = 0;
        
      
       
       
    }
};


