var GiroEntidad = pc.createScript('giroEntidad');
GiroEntidad.attributes.add('speed', {type: 'number', default:10});
GiroEntidad.attributes.add('axis', {type: 'number', default:0});
// initialize code called once per entity
GiroEntidad.prototype.initialize = function() {
    
};

GiroEntidad.prototype.update = function(dt) {
   
    if(this.axis == 0)
        this.entity.rotateLocal(dt*this.speed,0,0);
    else if(this.axis == 1)
        this.entity.rotateLocal(0,dt*this.speed,0);
    else if(this.axis == 2)
        this.entity.rotateLocal(0,0,dt*this.speed);
    
      
   
};



