// shake.js
var Shake = pc.createScript('shake'); 
Shake.attributes.add('cameraFake', {type: 'entity', title: 'cameraFake'});
    Shake.prototype.initialize = function() 
    {        
        this.timer = 0;
        this.shaking = false;
        this.amplitude = 1;
        this.duration = 0;
        this.frequency = 10;
        
        this.x = 0;
        this.y = 0;
        this.z = 0;
        
        this.offset = new pc.Vec3();
        this.position = new pc.Vec3();
    };

    Shake.prototype.reset = function () {
            this.shaking = false;
            this.offset.set(0, 0, 0);             
            //this.entity.setLocalPosition(this.position);
            //console.log("mi x local " + this.entity.getLocalPosition().x);
            vibrar = -1;
    };        
    Shake.prototype.shake = function (amplitude, duration)
    {
            if (this.shaking) {
                return;
            }
            this.amplitude = amplitude;
            this.duration = duration;
            this.timer = 0;            

            this.x = Math.random();
            this.y = Math.random();
            this.z = Math.random();
            this.lastTargetPosition = this.entity.getLocalPosition().clone();
            this.position.copy(this.entity.getLocalPosition());
            this.shaking = true;
    };
    Shake.prototype.update = function (dt) 
    {
        if(this.shaking)
        {
           
            var desiredPosition = new pc.Vec3();
            var lastTargetPosition =  this.cameraFake.getPosition().clone();
            desiredPosition.copy(lastTargetPosition);   
            var shake = this.getShake(dt);
            if(!shake)
                return;
            desiredPosition.add(shake);
            this.entity.setPosition(desiredPosition);
        }
    };
    Shake.prototype.getShake = function (dt) 
    {
            if (this.shaking) {
                
                var f = 1 - (this.timer / this.duration);

                this.offset.x = this.getNoise(this.x) * this.amplitude * f;
                this.offset.y = this.getNoise(this.y) * this.amplitude * f;
                this.offset.z = this.getNoise(this.z) * this.amplitude * f;

                this.timer += dt;
                if (this.timer > this.duration) {
                    this.reset();
                    return(false);
                }

                var f = this.frequency*dt;
                this.x += f;
                this.y += f;
                this.z += f;
            } else {
                this.offset.set(0,0,0);
            }

            return this.offset;
     };

     Shake.prototype.fade = function (t) 
     {
         return t * t * t * (t * (t * 6 - 15) + 10);
     };

     Shake.prototype.lerp = function (t, a, b) 
     {
         return a + t * (b - a);
     };

     Shake.prototype.getNoise = function (x)
     {    
            var i = Math.floor(x);
            x = x - i;
            var u = this.fade(x);
            
            var a = (perm[i] & 1) ? x : -x;
            var b = (perm[i+1] & 1) ? x - 1.0 : 1 - x;
            
            return this.lerp(u, a, b);
     };

   


// text.js
var Text = pc.createScript('text');

Text.attributes.add('text', { type: 'string', default: 'Hello World'});

Text.prototype.initialize = function () {
    // Create a canvas to do the text rendering
    this.canvas = document.createElement('canvas');
    this.canvas.height = 128;
    this.canvas.width = 512;
    this.context = this.canvas.getContext('2d');

    this.texture = new pc.Texture(this.app.graphicsDevice, {
        format: pc.PIXELFORMAT_R8_G8_B8,
        autoMipmap: true
    });
    this.texture.setSource(this.canvas);
    this.texture.minFilter = pc.FILTER_LINEAR_MIPMAP_LINEAR;
    this.texture.magFilter = pc.FILTER_LINEAR;
    this.texture.addressU = pc.ADDRESS_CLAMP_TO_EDGE;
    this.texture.addressV = pc.ADDRESS_CLAMP_TO_EDGE;

    this.updateText();

    var material = this.entity.model.material;
    material.emissiveMap = this.texture;
    material.opacityMap = this.texture;
    material.blendType = pc.BLEND_NORMAL;
    material.update();
    
    this.on('attr', function (name, value, prev) {
        this.updateText();
    });
       
};

Text.prototype.updateText = function () {
    var ctx = this.context;
    var w = ctx.canvas.width;
    var h = ctx.canvas.height;

    // Clear the context to transparent
    ctx.fillStyle = 'black';
    ctx.fillRect(0, 0, w, h);

    // Write white text
    ctx.fillStyle = 'white';
    ctx.font = 'bold 70px Verdana';
    ctx.textAlign = 'center';
    ctx.textBaseline = 'middle';
    ctx.fillText(this.text, w / 2, h / 2);
    //console.log(ctx);    
    //console.log("q mireda actualizare tesxto " + this.text);
    // Copy the canvas into the texture
    this.texture.upload();
};

// UISlider.js
var UISlider = pc.createScript('uiSlider');

UISlider.attributes.add('handle', {type: 'entity', default: null, title: 'Handle'});
UISlider.attributes.add('axis', {type: 'string', default: "y", title: 'Axis', description: 'lock drag to axis: x, y or xy'});
UISlider.attributes.add('guiButton', {type: 'entity'});

UISlider.prototype.initialize = function() {
    
    _masse = this;  
    this.screenX = 0;
    this.screenY = 0;
    this.forze = null;
    this.hitForze = 0;
    this.angle = 0;   
};

UISlider.prototype.postInitialize = function() {
    
    
   
    if( ! this.handle ) this.handle = this.entity.parent.findByName("UISliderHandle");
    
    if( this.handle ) this.addHandleListeners();
    else throw new Error( "UISlider has no handle" );
    
    this.isDragging = false;
    this.touchId = -1;
    this.mousePos = new pc.Vec3();    
    this.anchorPos = this.handle.getLocalPosition().clone();  
    this.screen = this.getUIScreenComponent();
};

UISlider.prototype.getUIScreenComponent = function() {
    return this.handle.element.screen.screen;
};

UISlider.prototype.addHandleListeners = function() {
    
    this.handle.element.useInput = true;
    
    this.handle.element.on(pc.EVENT_MOUSEDOWN, this.onPressDown, this);
    this.app.mouse.on(pc.EVENT_MOUSEUP, this.onPressUp, this);
    this.app.mouse.on(pc.EVENT_MOUSEMOVE, this.onPressMove, this);
        
    if(isMobile.any() )
    {
        console.log("initing touches");       
        this.handle.element.on(pc.EVENT_TOUCHSTART, this.onTouchStart, this);
        this.app.touch.on(pc.EVENT_TOUCHEND, this.onTouchEnd, this);
        this.app.touch.on(pc.EVENT_TOUCHCANCEL, this.onTouchEnd, this);
        this.app.touch.on(pc.EVENT_TOUCHMOVE, this.onTouchMove, this);
    }    
    
    this.on('destroy', function() {
        
        this.handle.element.off(pc.EVENT_MOUSEDOWN, this.onPressDown, this);
        this.app.mouse.off(pc.EVENT_MOUSEUP, this.onPressUp, this);
        this.app.mouse.off(pc.EVENT_MOUSEMOVE, this.onPressMove, this);

        if( isMobile.any() )
        {
            this.handle.element.off(pc.EVENT_TOUCHSTART, this.onTouchStart, this);
            this.app.touch.off(pc.EVENT_TOUCHEND, this.onTouchEnd, this);
            this.app.touch.off(pc.EVENT_TOUCHCANCEL, this.onTouchEnd, this);
            this.app.touch.off(pc.EVENT_TOUCHMOVE, this.onTouchMove, this);
        }
    });
    
};

UISlider.prototype.onTouchStart = function(ev) {
    var touch = ev.changedTouches[0];
    this.touchId = touch.identifier;
    this.startDrag( ev.x, ev.y );
    ev.event.stopPropagation();
};
UISlider.prototype.onTouchMove = function(ev) {
    for(var i=0; i< ev.changedTouches.length; i++ ) 
    {
        var t = ev.changedTouches[i];
        if( t.id == this.touchId )
        {
            ev.event.stopPropagation();           
            this.updateMove( t.x, t.y );
            return;
        }
    }
};
UISlider.prototype.onTouchEnd = function(ev) {
    for(var i=0; i< ev.changedTouches.length; i++ ) 
    {
        var t = ev.changedTouches[i];
        if( t.id == this.touchId )
        {
            ev.event.stopImmediatePropagation();
            this.touchId = -1;
            this.endDrag( t.x, t.y );
            return;
        }
    }
};


UISlider.prototype.onPressDown = function(ev) {
    ev.event.stopImmediatePropagation();
    this.startDrag(ev.x,ev.y);
};
UISlider.prototype.onPressUp = function(ev) {
    ev.event.stopImmediatePropagation();
    this.endDrag(ev.x,ev.y);
};
UISlider.prototype.onPressMove = function(ev) {
    this.updateMove(ev.x,ev.y);
    ev.event.stopImmediatePropagation();
};
        
