function RayCast(e,camara,APP)
{
   var from = camara.screenToWorld(e.x, e.y, camara.nearClip);
   var to = camara.screenToWorld(e.x, e.y, camara.farClip);
   var result = APP.systems.rigidbody.raycastFirst(from, to);
   if (result) {
       return(result.entity);       
   }
   return(null);
}

function GetMouseGlobalPosition(e,camara,APP)
{
   var from = camara.screenToWorld(e.x, e.y, camara.nearClip);
   var to = camara.screenToWorld(e.x, e.y, camara.farClip);
   var result = APP.systems.rigidbody.raycastFirst(from, to);  
  
   //console.log(result);
   if (result) {
       return result;       
   }
   return(null);
}
function GetMouseFloorPosition(e,camara,APP)
{
   var from = camara.screenToWorld(e.x, e.y, camara.nearClip);
   var to = camara.screenToWorld(e.x, e.y, camara.farClip);  
   result = APP.systems.rigidbody.raycastFiltered(from, to, PhysicsFilter.A, PhysicsFilter.A);    
   if (result) {
       return result;       
   }
   return(null);
}
