function addEventFunction(mc,poner,evento,funcion)
{   
    var ev = [];
    if(mc.element != null)
        mc = mc.element;
    switch(evento)
    {
        case 1:
            ev[0] = "touchstart";
            ev[1] = "mousedown";
        break;
        case 2:
            ev[0] = "touchend";
            ev[1] = "mouseup";
        break;
        case 3:
            ev[0] = "touchmove";
            ev[1] = "mousemove";
        break;
    }
    
    if(poner)
    {          
     
        if(isMobile.any()) 
        {           
            mc.on(ev[0],funcion);  
        }

      
        else       
            mc.on(ev[1],funcion);      

    }
    else
    {
       if(isMobile.any()) 
        {           
            mc.off(ev[0],funcion);  
        }

      
        else       
            mc.off(ev[1],funcion);      
    }
}

