function fromToRotation(v1,v2)
{
    var q = new pc.Quat();
    var kct = v1.dot(v2);
    k = Math.sqrt(v1.lengthSq() * v2.lengthSq());
    if(kct/k == -1) 
    {
         q.w = 0;
         var v = orthogonal(v1).normalize();
         q.x = v.x;
         q.y = v.y;
         q.z = v.z;
         return q;
    }
    q.w = kct + k;
    var cross = new pc.Vec3().cross(v1,v2);
    q.x = cross.x;
    q.y = cross.y;
    q.z = cross.z;
    return q.normalize();    

}
function orthogonal(v) 
{
    var x = Math.abs(v.x);
    var y = Math.abs(v.y);
    var z = Math.abs(v.z);
    var other = x < y ? ( x < z ? pc.Vec3.RIGHT : pc.Vec3.FORWARD ) : ( y < z ? pc.Vec3.UP : pc.Vec3.FORWARD );
    return new pc.Vec3().cross(v, other);
}


