AutoControl.prototype.preparaAuto = function()
{
    this.enPartida = false;
    this.finalCarrera = false;
    this.entity.enabled = true;
    this.speed = 0.011;
    _carSoundManager.iniciar();
    currentTematica = "playa";

    maxTurbo = autosData[autoElegido].turbo;
    
    this.maxSpeed = maxSpeed;
    this.maxSpeed = this.maxSpeed + autosData[autoElegido].maxSpeed*1.85;
    
    this.speedGiro = speedGiro;
    this.speedGiro = this.speedGiro + autosData[autoElegido].steering*1.22;
    
    this.aceleradaIni = aceleradaIni;
    this.aceleradaMid = aceleradaMid;
    this.aceleradaEnd = aceleradaEnd;
    
    this.aceleradaIni = aceleradaIni + autosData[autoElegido].aceleration*0.41;
    this.aceleradaMid = aceleradaMid + autosData[autoElegido].aceleration*0.31;
    this.aceleradaEnd = aceleradaEnd + autosData[autoElegido].aceleration*0.23;

    this.derrapeButtonApretado = false;
    this.derrapeMarcado = false;
    turbo = initialTurbo;
    turboBar = 1;
    delays = [500,1000,2000,2500,3000,3500];
    _menu.setTurbo(0);
    this.setSkyBox(0);
    distanceScore = 0;
    currentCheckpoint = 0;
    checkPointCant = 0;
    zoneClearedCant = 0;
    _globalScore = 0;
    _raceScore = 0;
    _menu.GUI_check.findByName("barra").setLocalScale(0,1,1);     
    distanciaCheckIni = _tramos.checkPoints[currentCheckpoint].getPosition().clone().distance(this.entity.getPosition().clone());
    
};
AutoControl.prototype.setSkyBox = function(n)
{
  
    for(var i = 0; i< this.skybox.children[0].children.length; i++)
        this.skybox.children[0].children[i].enabled = false;


    this.skybox.children[0].children[n].enabled = true;  
  
    for(var i = 1; i< this.pivoteCamaraAdAt.children.length;i++)
        this.pivoteCamaraAdAt.children[i].enabled = false;
    
    this.pivoteCamaraAdAt.children[n+1].enabled = true;
    
};
AutoControl.prototype.comienzaCarrera = function()
{
    this.enPartida = true;  
    playSound("Music1",true);
    this.poneEventos();
};

