AutoControl.prototype.recargaTurbo = function()
{
    if(maxTurbo == 0)
        return;
    
    playSound("turboRecarga");
    this.glow_auto.enabled = true;
    this.glow_auto.script.animaUvsPlus.play(0,1,1);
    _menu.setTurbo(0.5);
};
AutoControl.prototype.calculaSpeedGiro = function()
{
        var factor = 1;
        if (this.speedGiroCar < 1)
            factor = -1;
        var x1 = 0;
        var y1 = this.speedGiro;
        var x2 = this.maxSpeed;
        var y2 = this.speedGiro*0.7;

        var M = (y2 - y1) / (x2 - x1);
        var Y = M * (this.speed - x1) + y1;

        this.speedGiroCar = Y * factor/1.3;
};
AutoControl.prototype.calculaFactorInclinada = function()
{
    var x1 = 0;
    var y1 = 1;
    var x2 = this.maxSpeed;
    var y2 = 0.7;

    var M = (y2 - y1) / (x2 - x1);
    var Y = M * (this.speed - x1) + y1;
    Y = Y*this.factorNewVolante*2;
    if(Y > 1.9)
        Y = 1.9;
   
    return (Y);
};

AutoControl.prototype.vibratoIni = function(dt)
{
        //respiracionPiloto();
        if(this.vibrato.playing)
            return;
//            this.vibrato.tweenVar.stop();
        var vibratoLimiteAux = 0.5/80;
        var  speed = 20/80;
        if (this.vibratoCont >= vibratoLimiteAux)
            this.vibratoFlag = 1;
        else if (this.vibratoCont <= vibratoLimiteAux * -1)
            this.vibratoFlag = 0;


        if (this.vibratoFlag == 0 && this.vibratoCont <= vibratoLimiteAux)
            this.vibratoCont = this.vibratoCont + speed * dt;
        else if (this.vibratoFlag == 1 && this.vibratoCont >= vibratoLimiteAux * -1)
            this.vibratoCont = this.vibratoCont - speed * dt;
        if (this.vibratoCont > vibratoLimiteAux)
            this.vibratoCont = vibratoLimiteAux + 0.1/80;
        else if (this.vibratoCont < vibratoLimiteAux * -1)
            this.vibratoCont = vibratoLimiteAux * -1 - 0.1/80;
      
        this.vibrato.tweenVar = this.vibrato.tween(this.vibrato.getLocalRotation()).to(new pc.Vec3(this.vibratoCont, 0, 0),0.2,pc.SineOut);
        this.vibrato.tweenVar.start();
  
};


AutoControl.prototype.elTiempo = function(speed)
{
    var tiempo;

    if (speed <= 5)
        tiempo = 0.25;
    else if (speed < 20)
        tiempo = 0.22;
    else if (speed < 30)
        tiempo = 0.18;
    else
        tiempo = 0.129;


    return(tiempo);
};
AutoControl.prototype.seteaAcelerada = function(speed)
{
    if (speed < this.maxSpeed*0.45)
        this.acelerada = this.aceleradaIni;
    else if (speed < this.maxSpeed * 0.80)
        this.acelerada = this.aceleradaMid;
    else      
        this.acelerada = this.aceleradaEnd;

};
AutoControl.prototype.calculaSpeed = function(dt)
{ 

    if(time <= 0)
    {
        if (this.speed > 0)
            if (this.frenada < 0)
                this.speed = this.speed + dt * this.acelerada * 2 * this.frenada;
            else
                this.speed = this.speed + dt * -this.acelerada * 2 * this.frenada;
        else
            this.speed = 0;
        return (this.speed);            
    }

    if (this.enVoltereta)
    {
        this.speed = 0;
        return (this.speed);
    }


    if(this.enCaida)
    {
        this.speed = this.speed + dt * -this.acelerada/1.3 * this.frenada;

    }
    else if(this.enStunt == true)
    {
        if (this.speed > this.maxSpeed * 0.8)
            this.speed = this.maxSpeed * 0.8;


    }
    else if (!this.enDerrape)
    {
        if (!this.enLevantada)
        {
            if (this.superficie == 0)
            {
                if (this.speed > this.maxSpeed + 1)
                {
                    if(this.frenada < 0)
                        this.speed = this.speed + dt * this.acelerada * 2 * this.frenada;
                    else
                        this.speed = this.speed + dt * -this.acelerada * 2 * this.frenada;
                }
                else if (this.speed > this.maxSpeed)
                    this.speed = this.maxSpeed;
                else
                    this.speed = this.speed + dt * this.acelerada * this.frenada;
            }
            else if(this.superficie == 1)
            {
                if (this.speed > this.maxSpeed * 0.65 + 1)
                {
                    if (this.frenada < 0)
                        this.speed = this.speed + dt * acelerada * 3 * this.frenada;
                    else
                        this.speed = this.speed + dt * -this.acelerada * 3 * this.frenada;
                }
                else if (this.speed > this.maxSpeed * 0.85)
                    this.speed = this.maxSpeed * 0.85;
                else
                    this.speed = this.speed + dt * this.acelerada / 4.5 * this.frenada;
            }
        }
        else
        {
            if (this.superficie == 0)
            {
                if (this.speed > this.maxSpeed * 1.18)
                    this.speed = this.maxSpeed * 1.18;
                else
                    this.speed = this.speed + dt * this.acelerada*2.6 * this.frenada;
            }
            else if (this.superficie == 1)
            {
                if (this.speed > this.maxSpeed*0.85 * 1.15)
                    this.speed = this.maxSpeed*0.85 * 1.15;
                else
                    this.speed = this.speed + dt * this.acelerada/4.5 * this.frenada;
            }

        }

    }
    else
    {
        if (this.superficie == 0)
        {
            if (this.speed > this.maxSpeed * 0.72)
            {

                //Debug.Log("lo malo " + frenada);
                var rest = 0;
                if(this.frenada < 0)
                    rest = dt * this.acelerada * 3.5 * this.frenada;
                else
                    rest = dt * this.acelerada * 0.2 * this.frenada;
                if (this.frenada < 0)
                    rest = Math.abs(rest);
                else
                    rest = Math.abs(rest) * -1;
                this.speed = this.speed - rest;


            }
            else
            {
                this.speed = this.speed + dt * this.acelerada * 0.5 * this.frenada;
            }
            if (this.speed > this.maxSpeed * 0.85)
                this.speed = this.maxSpeed * 0.85;


        }
        else if(this.superficie == 1)
        {
            this.speed = this.speed + dt * this.acelerada/5 * this.frenada;
            if (this.speed > this.maxSpeed * 0.35)
            {
                if (this.frenada < 0)
                    this.speed = this.speed + dt * this.acelerada * 5 * this.frenada;
                else
                    this.speed = this.speed + dt * -this.acelerada * 5 * this.frenada;
            }
            else
                this.speed = this.speed + dt * this.acelerada / 5.5 * this.frenada;
        }

    }        

    if (this.enDerrape == true && this.enCaida == false)
    {
        if (this.speed < this.maxSpeed * this.speedEnDerrape)
        {                
            this.enDerrape = false;
            _carSoundManager.StopSkid();
            this.speedGiro = this.realSpeedGiro;
            if(this.autoMotoDerrape.tweenVar != null)
                this.autoMotoDerrape.tweenVar.stop();
             this.autoMotoDerrape.tweenVar = this.autoMotoDerrape.tween(this.autoMotoDerrape.getLocalEulerAngles()).rotate(new pc.Vec3(0,0,0),0.4,pc.SineOut).start();
            //this.autoMotoDerrape.DOLocalRotate(new Vector3(0, 180, 0), 0.4);
            clearInterval(this.hiloReiniciarDerrape);
        }
    }

    if (this.speed < 0)
        this.speed = 0;




    if(this.esMoto == true)
    {
        this.ruedaTBackDer.rotateLocal(-this.speed * dt*35, 0,0);
        this.ruedaTDer.rotateLocal(-this.speed * dt*35, 0, 0);
    }
    else
    {            
        this.ruedaTBackDer.rotateLocal(-this.speed *dt * 35, 0, 0);
        this.ruedaTDer.rotateLocal(-this.speed * dt * 35, 0, 0);
        this.ruedaTIzq.rotateLocal(-this.speed * dt * 35, 0, 0);
        //this.ruedaTDerGiro.tweenVar.stop();
        //this.ruedaTIzqGiro.tweenVar.stop();

        if (this.enGiroIzq == 1)
        {
            this.ruedaGiro = this.ruedaGiro +dt *  400;
            if (this.ruedaGiro >= this.limiteRuedaGiro/1.8)
                this.ruedaGiro = this.limiteRuedaGiro/1.8;
        }
        else if(this.enGiroDer == 1)
        {

            this.ruedaGiro = this.ruedaGiro - dt * 400;
            if (this.ruedaGiro <= -this.limiteRuedaGiro/1.8)
                this.ruedaGiro = -this.limiteRuedaGiro/1.8;
        }
        else
        {
            if(Math.abs(0 - this.ruedaGiro) <= 1)
            {
                this.ruedaGiro = 0;
            }
            else if(this.ruedaGiro < 0)
            {
                this.ruedaGiro = this.ruedaGiro + dt * 400;
            }
            else if(this.ruedaGiro > 0)
            {
                this.ruedaGiro = this.ruedaGiro - dt * 400; 
            }


        }
         this.ruedaTDerGiro.setLocalEulerAngles(new pc.Vec3(0,this.ruedaGiro,0));
         this.ruedaTIzqGiro.setLocalEulerAngles(new pc.Vec3(0,this.ruedaGiro,0));
        //this.ruedaTDerGiro.tweenVar = this.ruedaTDerGiro.tween(this.ruedaTDerGiro.getLocalRotation()).to(new pc.Vec3(0,this.ruedaGiro,0),0.1,pc.Linear).start();   
        //this.ruedaTIzqGiro.tweenVar = this.ruedaTIzqGiro.tween(this.ruedaTIzqGiro.getLocalRotation()).to(new pc.Vec3(0,this.ruedaGiro,0),0.1,pc.Linear).start();   
    }

    return (this.speed);
};

AutoControl.prototype.calculaCamaraATAD = function(speed)
{
    
    if(this.pivoteCamaraATADIni == null)
        return;
    
    speed = speed;
    var x1;
    var y1;
    var x2;
    var y2;

    var x11;
    var y11;
    var x22;
    var y22;
    var M2;

    var M;
    var mySpeed;
    var matar = true;

    var elY = 0;
    var Y = 0;
    var factorZoom = 1;
    
    if (speed > 2)
    {
        factorZoom = 1.1;
        x1 = 2/factorZoom;
        y1 = 0.268/factorZoom;
        x2 = (this.maxSpeed/factorZoom) / 2 - (15/factorZoom);
        y2 = -0.97/factorZoom;//-0.28f;

        M = (y2 - y1) / (x2 - x1);
        mySpeed = speed/factorZoom;
        if (mySpeed > x2)
            mySpeed = x2;

        this.oldSpeed = speed;


        x11 = 2/factorZoom;
        y11 = 0;
        x22 = (this.maxSpeed/factorZoom) / 2 - (15/factorZoom);
        y22 = 0.48/factorZoom;

        M2 = (y22 - y11) / (x22 - x11);

        elY = M2 * (mySpeed - x11) + y11;
     
        Y = M * (mySpeed - x1) + y1;
        if(elY > 0.13)
        {
            elY = 0.13;
            Y = this.elYOld;
        }
    }
    else
    {
        factorZoom = 1.1;
        x1 = 0;
        y1 = this.pivoteCamaraATADIni.z;
        x2 = 2/factorZoom;
        y2 = 0.268/factorZoom;

        M = (y2 - y1) / (x2 - x1);
        mySpeed = speed/factorZoom;
        if (mySpeed > x2)
            mySpeed = x2;

        if (this.oldSpeed != speed)
        {

        }
        elY = 0;
        this.oldSpeed = speed;
        Y = M * (mySpeed - x1) + y1;

    }
    
    this.elYOld = Y;
    
    
    //this.pivoteCamaraAdAt.setLocalPosition(new pc.Vec3(pivoteCamaraAdAt.localPosition.x, pivoteCamaraAdAt.localPosition.y, Y));       
    //this.pivoteCamaraAdAt.DOKill();
    this.pivoteCamaraAdAt.tween(this.pivoteCamaraAdAt.getLocalPosition()).to(new pc.Vec3(0,elY,Y),0.2,pc.SineOut).start();       
    

};
	
AutoControl.prototype.configuraVolante = function(dt)
{
    if (this.enChoque == true)
        return;
    if (this.speed == 0)
        return;

    if (this.enGiroIzq == 1 && this.enGiroDer == 1)
        return;

    if (this.enGiroIzq == 1 || this.enGiroDer == 1)
    {
        this.volante = this.volante + dt * -this.speedGiroCar*this.factorNewVolante;          
    }     
};



