AutoControl.prototype.ajustarDeltaPivoteCamara = function(punto)
{
    return;
    var tiempo = this.elTiempo(this.speed);
    //Debug.Log(punto);

    
    var x1 = 0;
    var y1 = -0.117;

    var x2 = -0.2;
    var y2 = -0.125;//1.51;

    ////console.kig("el y rq " + punto.y);
    
    if(punto.y > 0.1)
    {
        x2 = 0.2;
        y2 = -0.1;//1.29;
    }

    var M = (y2 - y1) / (x2 - x1);

    var elY = M * (punto.y - x1) + y1;

    x1 = 0;
    y1 = 0.472;

    x2 = -0.2;
    y2 = 0.4; //- 0.83f;

    if (punto.y > 0.1)
    {
        x2 = 0.2;
        y2 = 0.58;
    }

    M = (y2 - y1) / (x2 - x1);

    var elZ = M * (punto.y - x1) + y1;

    x1 = 0;
    y1 = 0.472;

    x2 = -0.2;
    y2 = 0.28;

    if (punto.y > 0.1)
    {
        x2 = 0.2;
        y2 = 0.6;
    }

    M = (y2 - y1) / (x2 - x1);

    var elAngX = M * (punto.y - x1) + y1;

    //this.camara.transform.DOKill();



    if(punto.y < 0.1 && punto.y > -0.1)
    {
        if((this.camara.tweenVar != null && !this.camara.tweenVar.playing) || this.camara.tweenVar == null)       
            this.camara.tweenVar = this.camara.tween(this.camara.getLocalPosition()).to(new pc.Vec3(0,-0.117,this.deltaPivoteCamara[6]),tiempo*2,pc.Linear).start();  
        this.camara.tween(this.camara.getLocalEulerAngles()).rotate(new pc.Vec3(0,180,0),tiempo*2,pc.Linear).start();    
         //this.camara.setLocalPosition(new pc.Vec3(0,-0.117,this.deltaPivoteCamara[6]));

    }
    else
    {
        //this.camara.setLocalPosition(new pc.Vec3(0,elY, elZ));
      if((this.camara.tweenVar != null && !this.camara.tweenVar.playing) || this.camara.tweenVar == null)  
         this.camara.tweenVar = this.camara.tween(this.camara.getLocalPosition()).to(new pc.Vec3(0,elY, elZ),tiempo*2,pc.Linear).start();  
        this.camara.tween(this.camara.getLocalEulerAngles()).rotate(new pc.Vec3(elAngX, 180, 0),tiempo*2,pc.Linear).start();           

    }
};

