AutoControl.prototype.desactivarChoque = function()
{
    clearInterval(this.hiloDesactivarChoque);
    this.activarChoqueParticulas = false;
};
AutoControl.prototype.seteaDenegarDerrape = function()
{
    clearInterval(this.hiloSeteaDenegarDerrape);
    this.denegarDerrape = false;
};

AutoControl.prototype.calculaFuerzaChoque = function(speed)
{
        var x1 = 0;
        var y1 = 0.5;
        var x2 = this.maxSpeed * 1.15;
        var y2 = 13;

        var M = (y2 - y1) / (x2 - x1);
        var Y = M * (speed - x1) + y1;

        return (Y);
};
AutoControl.prototype.reiniciarDerrape = function()
{
    clearInterval(this.hiloReiniciarDerrape);
    this.enDerrape = false;   
    this.speedGiro = this.realSpeedGiro;
    _carSoundManager.StopSkid();
};
AutoControl.prototype.finLevantada = function()
{
    
    this.carroseriaLevantada.setLocalEulerAngles(new pc.Vec3(0, 0, 0));
    
    var p = {       
              x:this.camara.camera.fov
            };
                   
    this.camara.tweenVar = this.app.tween(p).to({x: 70}, 0.4, pc.SineOut);
    this.camara.tweenVar.on('update', function() {
        this.camara.camera.fov = p.x;
    }.bind(this)).start();
    
     var p2 = {       
              x:this.camaraSkyBox.camera.fov
            };
    this.camaraSkyBox.tweenVar = this.app.tween(p2).to({x: 70}, 0.4, pc.SineOut);
    this.camaraSkyBox.tweenVar.on('update', function() {
        this.camaraSkyBox.camera.fov = p2.x;
    }.bind(this)).start();
   
    //clearInterval(this.hiloPosibleFinLevantada);
    //clearInterval(this.hiloFinLevantada);
    //clearInterval(this.hiloReiniciaLevantada);
    
    if(this.hiloPosibleFinLevantada != null)
        this.hiloPosibleFinLevantada.stop();
     if(this.hiloFinLevantada != null)
        this.hiloFinLevantada.stop();
    if(this.hiloReiniciaLevantada != null)
        this.hiloReiniciaLevantada.stop();
    
    //this.hiloReiniciaLevantada = setInterval(this.reiniciaLevantada.bind(this),0.2*1000);     
    var p3 = { x:0};
    this.hiloReiniciaLevantada = this.app.tween(p3).to({x: 10}, 0.2, pc.Linear).on('complete',this.reiniciaLevantada.bind(this)).start(); 
    
    this.turboManual = false;
    //this.detiene_efectoTurbo();

};
