AutoControl.prototype.metodoLevantada = function()
{
    if(this.enLevantada)
        return;
    
    if(this.carroseriaLevantada.tweenVar != null)
        this.carroseriaLevantada.tweenVar.stop();
    
    if(this.camara.tweenVar != null)
        this.camara.tweenVar.stop();
    
    if(this.camaraSkyBox.tweenVar != null)
        this.camaraSkyBox.tweenVar.stop();
    
    this.carroseriaLevantada.tweenVar =  this.carroseriaLevantada.tween(this.carroseriaLevantada.getLocalEulerAngles()).rotate(new pc.Vec3(this.anguloLevantada, 0, 0),0.3,pc.SineOut); 
    this.carroseriaLevantada.tweenVar.start();
   
    var p = {       
              x:this.camara.camera.fov
            };
                   
    this.camara.tweenVar = this.app.tween(p).to({x: 90}, 0.3, pc.SineOut);
    this.camara.tweenVar.on('update', function() {
        this.camara.camera.fov = p.x;
    }.bind(this)).start();
    
     var p2 = {       
              x:this.camaraSkyBox.camera.fov
            };
    this.camaraSkyBox.tweenVar = this.app.tween(p2).to({x: 90}, 0.3, pc.SineOut);
    this.camaraSkyBox.tweenVar.on('update', function() {
        this.camaraSkyBox.camera.fov = p2.x;
    }.bind(this)).start();
   
    this.speed = this.speed + this.speedLevantada;
    this.enLevantada = true;
    playSound("turbo");
   
    //setVolumeSound();
   
    //clearInterval(this.hiloFinLevantada);
    //clearInterval(this.hiloPosibleFinLevantada);
    
    if(this.hiloPosibleFinLevantada != null)
        this.hiloPosibleFinLevantada.stop();
     if(this.hiloFinLevantada != null)
        this.hiloFinLevantada.stop();
    
    var p3 = { x:0};
    this.hiloPosibleFinLevantada = this.app.tween(p3).to({x: 10}, 0.2, pc.Linear).on('complete',this.posiblefinLevantada.bind(this)).start();
    //this.hiloPosibleFinLevantada = setInterval(this.posiblefinLevantada.bind(this),0.2*1000);      
    //this.hiloFinLevantada = setInterval(this.finLevantada.bind(this), 1.2*1000);  
    var p4 = { x:0};
    this.hiloFinLevantada = this.app.tween(p4).to({x: 10}, 1.2, pc.Linear).on('complete',this.finLevantada.bind(this)).start();
};
AutoControl.prototype.pauseTweens = function()
{
    if(this.pauseGame)
    {
        if(this.hiloPosibleFinLevantada != null)
            this.hiloPosibleFinLevantada.pause();
        if(this.hiloFinLevantada != null)
            this.hiloFinLevantada.pause();         
        if(this.hiloReiniciaLevantada != null)
            this.hiloReiniciaLevantada.pause();
    }
    else
    {
        if(this.hiloPosibleFinLevantada != null)
            this.hiloPosibleFinLevantada.resume();
        if(this.hiloFinLevantada != null)
            this.hiloFinLevantada.resume();
        if(this.hiloReiniciaLevantada != null)
            this.hiloReiniciaLevantada.resume();
    }
};

AutoControl.prototype.buscarDireccion = function()
{
   this.sentido = 1;
    return;
    var hitIzq = null;
    var hitDer = null;

    var hitIzqUp = null;
    var hitDerUp =  null;

    //LayerMask layer = layer = 1 << LayerMask.NameToLayer("colisiones");
    
    var to = new pc.Vec3();
    to.add2(this.rayoT.getPosition(),this.rayoT.right.scale(-4));

    hitIzq = this.app.systems.rigidbody.raycastFirst(this.rayoT.getPosition(),to);//this.rayoT.right.scale(-1)); 
    
    to = new pc.Vec3();
    to.add2(this.rayoT.getPosition(),this.rayoT.right.scale(4));
    hitDer = this.app.systems.rigidbody.raycastFirst(this.rayoT.getPosition(),to);//this.rayoT.right); 

    
    to = new pc.Vec3();
    to.add2(this.rayoT.getPosition().add(this.rayoT.right.scale(4)),this.rayoT.forward.scale(-4));
    hitIzqUp = this.app.systems.rigidbody.raycastFirst(this.rayoT.getPosition().add(this.rayoT.right),to); 
    
     to =  new pc.Vec3();
    to.add2(this.rayoT.getPosition().sub(this.rayoT.right.scale(4)),this.rayoT.forward.scale(-4));
    hitDerUp = this.app.systems.rigidbody.raycastFirst(this.rayoT.getPosition().sub(this.rayoT.right),to); 


    this.sentido = 0;
    var distanceIzq = 0;
    var distanceDer = 0;

    var distanceIzqUp = 0;
    var distanceDerUp = 0;

    if(hitIzq)    
        distanceIzq = hitIzq.point.distance(this.rayoT.getPosition());
    if(hitDer)    
        distanceDer = hitDer.point.distance(this.rayoT.getPosition());

    if(hitIzqUp)    
        distanceIzqUp = hitIzqUp.point.distance(this.rayoT.getPosition().add(this.rayoT.right));
    if(hitDerUp)    
        distanceDerUp = hitDerUp.point.distance(this.rayoT.getPosition().sub(this.rayoT.right));
    
    
    
    if(hitIzq)
    {
        if(conDebugRay)
        {
            var start = this.rayoT.getPosition();
            var end = hitIzq.point;
            var color = new pc.Color(1, 0, 0);
            this.app.renderLine(start, end, color);
        }
    }
    if(hitDer)
    {
        if(conDebugRay)
        {
            var start = this.rayoT.getPosition();
            var end = hitDer.point;
            var color = new pc.Color(1, 0, 0);
            this.app.renderLine(start, end, color);
        }
    }
      
    
    var distancia = distanceIzq <= distanceDer;

    if (hitIzq && distancia == true && esColiderBordes(hitIzq))
    {
        if (hitIzq.entity.name  == "bordeIzq")
        {
            this.sentido = 1;
        }
        else if (hitIzq.entity.name == "bordeDer")
        {
            this.sentido = -1;
        }
        this.lado = "der";
    }
    else if (hitDer && distancia == false && esColiderBordes(hitDer))
    {
        if (hitDer.entity.name == "bordeDer")
        {
            this.sentido = 1;
        }
        else if (hitDer.entity.name == "bordeIzq")
        {
            this.sentido = -1;
        }
        this.lado = "izq";
    }


    if (this.sentido == 0)
    {
        distancia = distanceIzqUp <= distanceDerUp;

        if (hitIzqUp  &&  hitDerUp)
        {
            if (hitIzqUp.entity.name == "bordeIzq" && hitDerUp.entity.name == "bordeIzq")
            {
                if (distancia == false)
                    this.sentido = 1;
                else
                    this.sentido = -1;
            }
            else if (hitIzqUp.entity.name == "bordeDer" && hitDerUp.entity.name == "bordeDer")
            {
                if (this.distancia == false)
                    this.sentido = -1;
                else
                    this.sentido = 1;
            }
        }
    }
    
    /*if(this.sentido == 0)
        this.sentido = 1;*/


};
