AutoControl.prototype.casoApretarDerecha = function(posibleDerrape)
{

    ////console.kig("aprete la derecha");
    if (this.finalCarrera)
        return;

    if (this.enCaida == true)
        return;

    if (this.pauseGame == true)
        return;

   this.hiloCasoSoltarDerecha = clearInterval(this.hiloCasoSoltarDerecha);

    if (this.hiloCasoSoltarIzquierda != null)
    {
        this.hiloCasoSoltarIzquierda = clearInterval(this.hiloCasoSoltarIzquierda);
        this.casoSoltarIzquierda();       
    }
    if (this.enGiroDer == 1 && posibleDerrape && (this.factorNewVolante > 1.02 || pcControl) )
    {
        if (this.ladoDerrape == "derecha")
        { 
            this.casoDerrape();
            this.ladoDerrape = "";
        }
    }        
    this.enGiroDer = 1;

    if (this.speedGiroCar < 0)
       this.speedGiroCar = this.speedGiroCar * -1;



    if (this.enGiroIzq == 1)
    {
        if (this.enDerrape == true)
        {              
            if(this.autoMotoDerrape.tweenVar != null)
                this.autoMotoDerrape.tweenVar.stop();
            this.autoMotoDerrape.tweenVar = this.autoMotoDerrape.tween(this.autoMotoDerrape.getLocalEulerAngles()).rotate(new pc.Vec3(0,0,0),0.4,pc.SineOut).on('update',this.rotPiloto.bind(this)).start();

            if(this.camaraDobla.tweenVar != null)
                this.camaraDobla.tweenVar.stop();
            this.camaraDobla.tweenVar = this.camaraDobla.tween(this.camaraDobla.getLocalEulerAngles()).rotate(new pc.Vec3(0,0,0),0.3,pc.SineOut).start();   
            
            
            clearInterval(this.hiloReiniciarDerrape);    
            this.hiloReiniciarDerrape = setInterval(function(){
                clearInterval(this.hiloReiniciarDerrape);    
                if(this.enGiroDer == 1 && this.enGiroIzq == 1 && this.enDerrape)
                {
                    this.hiloReiniciarDerrape = setInterval(this.reiniciarDerrape.bind(this),0.25*1000);            
                    this.autoMotoGiro.tween(this.autoMotoGiro.getLocalEulerAngles()).rotate(new pc.Vec3(0, 0,0),0.3,pc.SineOut).start();  
                }
            }.bind(this),300);            
        
        }
        else
        {
            if(this.autoMotoGiro.tweenVar != null)
                this.autoMotoGiro.tweenVar.stop();
            this.autoMotoGiro.tweenVar = this.autoMotoGiro.tween(this.autoMotoGiro.getLocalEulerAngles()).rotate(new pc.Vec3(0,0,0),0.3,pc.SineOut).on('update',this.rotPiloto.bind(this)).start();

            if(this.camaraDobla.tweenVar != null)
                this.camaraDobla.tweenVar.stop();
            this.camaraDobla.tweenVar = this.camaraDobla.tween(this.camaraDobla.getLocalEulerAngles()).rotate(new pc.Vec3(0,0,0),0.3,pc.SineOut).start();               


        }
    }
    else
    {
        if (this.enDerrape == false)
        {
            this.ladoDerrape = "derecha";
            if (this.enLevantada == false)
            {               
                var factor = 0.35;
                this.doblaCarroseria("derecha");
                if(this.camaraDobla.tweenVar != null)
                    this.camaraDobla.tweenVar.stop();
                var f = this.giroDobladaCamaraMaximo*factor*2;
                if(f >= 5.7)
                    f = 5.7
                    this.camaraDobla.tweenVar = this.camaraDobla.tween(this.camaraDobla.getLocalEulerAngles()).rotate(new pc.Vec3(0, 0, -1*f),0.3,pc.SineOut).start();  
            }
            else
            {
                var factor = 0.35;
                if (!this.esMoto)
                    this.autoMotoGiro.tween(this.autoMotoGiro.getLocalEulerAngles()).rotate(new pc.Vec3(0, -this.inclinacionNormalMaxima * factor, +0 * factor),0.3,pc.SineOut).start();                        
                else
                {
                    this.autoMotoGiro.tween(this.autoMotoGiro.getLocalEulerAngles()).rotate(new pc.Vec3(0, 0 * factor, -this.inclinacionNormalMaxima * factor),0.3,pc.SineOut).on('update',this.rotPiloto.bind(this)).start();                          
                }
                if(this.camaraDobla.tweenVar != null)
                    this.camaraDobla.tweenVar.stop();
                this.camaraDobla.tweenVar = this.camaraDobla.tween(this.camaraDobla.getLocalEulerAngles()).rotate(new pc.Vec3(0, 0, (-this.giroDobladaCamaraMaximo)/2),0.3,pc.SineOut).start();  
            }
        }
        else
        {
            //var factor = this.calculaFactorInclinada()
            if(pcControl && controlDefaultType == 0)
            {
                if(!this.derrapeButtonApretado)//if(ladoAnterior == "izq")
                {
                    this.reiniciarDerrape();
                    this.doblaCarroseria("derecha");
                }
                else
                {
                    this.doblaCarroseria("derecha");
                    _carSoundManager.PlaySkid();
                }
            }
            else
            {
                this.doblaCarroseria("derecha");
                _carSoundManager.PlaySkid();
            }
        }          
    }      
};
AutoControl.prototype.doblaCarroseria = function(tipo)
{
    if(tipo == "derecha")  
    {

        var factor = this.calculaFactorInclinada();
        if (!this.esMoto)
        {

            this.autoMotoGiro.tween(this.autoMotoGiro.getLocalEulerAngles()).rotate(new pc.Vec3(0, -this.inclinacionNormalMaxima * factor,0 * factor),0.3,pc.SineOut).start();                       
        }
        else
        {
            this.autoMotoGiro.tween(this.autoMotoGiro.getLocalEulerAngles()).rotate(new pc.Vec3(0, -this.inclinacionNormalMaxima * factor, 0 * factor),0.3,pc.SineOut).on('update',this.rotPiloto.bind(this)).start();                       
        }

    }
    else if(tipo == "izquierda")  
    {
        var factor = this.calculaFactorInclinada();
        if (!this.esMoto)
        {
            this.autoMotoGiro.tween(this.autoMotoGiro.getLocalEulerAngles()).rotate(new pc.Vec3(0,  this.inclinacionNormalMaxima * factor,0 * factor),0.3,pc.SineOut).start();                        
        }
        else
        {
            this.autoMotoGiro.tween(this.autoMotoGiro.getLocalEulerAngles()).rotate(new pc.Vec3(0, this.inclinacionNormalMaxima * factor,0 * factor),0.3,pc.SineOut).on('update',this.rotPiloto.bind(this)).start();                       
        }        
    }
    if(this.enDerrape)
    {
        if(tipo == "derecha")  
        {
            var factor = this.calculaNewDerrape();
            ////console.kig("PERO Q WEA DA ESOT?!?! }  " + factor);

            if(this.autoMotoDerrape.tweenVar != null)
                this.autoMotoDerrape.tweenVar.stop();
            this.autoMotoDerrape.tweenVar = this.autoMotoDerrape.tween(this.autoMotoDerrape.getLocalEulerAngles()).rotate(new pc.Vec3(0,  -factor, this.inclinacionDerrapeMaxima),0.5,pc.SineOut).on('update',this.rotPiloto.bind(this)).start();
            clearInterval(this.hiloReiniciarDerrape);

            if(this.camaraDobla.tweenVar != null)
                this.camaraDobla.tweenVar.stop();
            this.camaraDobla.tweenVar = this.camaraDobla.tween(this.camaraDobla.getLocalEulerAngles()).rotate(new pc.Vec3(0, 0, -this.giroDobladaCamaraDerrapeMaximo),0.3,pc.SineOut).start();    
        }
        else if(tipo == "izquierda")
        {
            var factor = this.calculaNewDerrape();
            if(this.autoMotoDerrape.tweenVar != null)
                this.autoMotoDerrape.tweenVar.stop();

            // //console.kig(factor);

            this.autoMotoDerrape.tweenVar = this.autoMotoDerrape.tween(this.autoMotoDerrape.getLocalEulerAngles()).rotate(new pc.Vec3(0, factor, -this.inclinacionDerrapeMaxima),0.5,pc.SineOut).on('update',this.rotPiloto.bind(this)).start();
            clearInterval(this.hiloReiniciarDerrape);

            if(this.camaraDobla.tweenVar != null)
                this.camaraDobla.tweenVar.stop();
            this.camaraDobla.tweenVar = this.camaraDobla.tween(this.camaraDobla.getLocalEulerAngles()).rotate(new pc.Vec3(0, 0, this.giroDobladaCamaraDerrapeMaximo),0.3,pc.SineOut).start();      
        }
    }
};
