{
    this.casoSoltarDerecha();
    this.casoSoltarIzquierda();
    this.speed = 0;
    _traficoSystem.matar();
    clearInterval(_menu.hiloTiempo);
    _sonidos.slot("pocoTiempo").stop();
    if(conMusica)
    {
        _sonidos.slot("Music1").stop();
        _sonidos.slot("Music2").stop();
        _sonidos.slot("Music3").stop();
    }
    this.finLevantadaInsta();
    this.seteaDenegarDerrape();
    this.reiniciarDerrape();
    this.prendeTurbos("izq",false);
    this.prendeTurbos("der",false);
    this.prendeDerrapes("tierra",false);
    this.prendeDerrapes("humo",false);
    this.configuraParticulas();
    //clearInterval(this.hiloPosibleFinLevantada);  
    //clearInterval(this.hiloReiniciaLevantada);
    //clearInterval(this.hiloFinLevantada);
    
     if(this.hiloPosibleFinLevantada != null)
        this.hiloPosibleFinLevantada.stop();
     if(this.hiloFinLevantada != null)
        this.hiloFinLevantada.stop();
    if(this.hiloReiniciaLevantada != null)
        this.hiloReiniciaLevantada.stop();

    this.mataEventos();     
    this.enPartida = false;
    _menu.sacaEventosHud();
    this.carroseria.setPosition(this.entity.getPosition());
    this.carroseria.translateLocal(0, 0, -0.1*0.8);         
    this.contenedorCamara.setPosition(this.entity.getPosition());        
    this.calculaCamaraATAD(this.speed);
    this.skybox.setLocalPosition(new pc.Vec3(this.entity.getLocalPosition().x,this.skybox.getLocalPosition().y,this.entity.getLocalPosition().z));       

    permitirPause = false;
};

