function onPause() {
    // Handle the pause event
    console.log("en pause!! MOBILE");          
    {
        currentMuteSound = muteValSound;
        currentMuteMusic = muteValMusic;
        
        currentAudioGameSnack = GAMESNACKS.isAudioEnabled();  
        
        var muteSound = _menu.pausePanel.findByName("muteSound");
        var muteMusic = _menu.pausePanel.findByName("muteMusic");
        
        mutear(1,"sound");
        muteSound.children[1].enabled = true;
        muteSound.children[0].enabled = false;

        mutear(1,"music");
        muteMusic.children[1].enabled = true;
        muteMusic.children[0].enabled = false;        
                  

        if(currentMuteSound == 0)
        {
            mutear(0,"sound");
            muteSound.children[0].enabled = true;
            muteSound.children[1].enabled = false;
        }
        if(currentMuteMusic == 0)
        {
            mutear(0,"music");
            muteMusic.children[0].enabled = true;
            muteMusic.children[1].enabled = false;
        }
        if(pantalla == "321GO")
            pauseFlag = true;
        if(permitirPause)
            _menu.clickPause();
    }
}


function onResume() {
    // Handle the resume event
    console.log("en resumen!! MOBILE");
    
    var audioON = GAMESNACKS.isAudioEnabled();      
    if(audioON != currentAudioGameSnack)
    {
        if(audioON)
        {
            currentMuteSound = 0;
            currentMuteMusic = 0;        
        }
        else
        {
            currentMuteMusic = 1;
            currentMuteSound = 1;
        }
    }
    
    var muteSound = _menu.pausePanel.findByName("muteSound");
    var muteMusic = _menu.pausePanel.findByName("muteMusic");    
       
    mutear(currentMuteSound,"sound");
    if(currentMuteSound == 0)
    {
        muteSound.children[0].enabled = true;
        muteSound.children[1].enabled = false;
    }
    else
    {
        muteSound.children[1].enabled = true;
        muteSound.children[0].enabled = false;
    }
    
    mutear(currentMuteMusic,"music");
    if(currentMuteMusic == 0)
    {
        muteMusic.children[0].enabled = true;
        muteMusic.children[1].enabled = false;
    }
    else
    {
        muteMusic.children[1].enabled = true;
        muteMusic.children[0].enabled = false;
    }    
  
}

