// initialize code called once per entity
Menu.prototype.initialize = function() {
    
    _menu = this;  
    this.currentColor = "normal";
    this.plataforma = this.main3D.findByName("plataformas");
    //localStorage.clear();
    getAllVars();
    this.indexPlataforma = autoElegido;
    this.GUI_colores.children[autoElegido].enabled = true;
    this.selectAuto(autoElegido);
    this.anguloPlataforma = 0;
    this.tweenPlataforma = null;
    this.ladoAux = 0;
    this.poneEventosMain();
    this.setPlataforma(true);
    this.setGameGUI(false);
    this.setMainGUI(true,false);  
    playSound('menuMusic',true);
    this.enGarage = false;
    this.pintarMonedas();
    this.pintarBestScore();
    permitirPause = false;
    if(isMobile.any())
        pcControl = false;
    else
        pcControl = true;
    
    pantalla = "menu";
    GAMESNACKS.gameReady();
    GAMESNACKS.subscribeToAudioUpdates(this.audioChange.bind(this));
    
    this.tap = 0;
    this.press = false;
    this.hiloTap = null;
    this.toleranciaTap = 300;
    //this.setMessages(false);
    
    
    this.GUI_tapador.enabled = true;
    this.GUI_tapador.element.opacity = 1;
    var p = {       
       x: 1
    };
    this.app.tween(p).to({x: 0}, 1.1, pc.SineOut).on('update',function(){
        this.GUI_tapador.element.opacity = p.x;
    }.bind(this)).on('complete',function(){     
            this.GUI_tapador.enabled = false;   
            fps.bench();
    }.bind(this)).start();
    
    
};
Menu.prototype.setPlataforma = function(instant)
{
    this.anguloPlataforma = -60*autoElegido;
    var plataforma = this.plataforma;
    if(instant)
        plataforma.setLocalEulerAngles(0,this.anguloPlataforma,0);
    else
        this.tweenPlataforma = plataforma.tween(plataforma.getLocalEulerAngles()).rotate(new pc.Vec3(0, this.anguloPlataforma, 0),0.6,pc.SineOut).start().on('complete',function(){
            this.GUI_colores.children[this.ladoAux].enabled = false;
            this.GUI_colores.children[autoElegido].enabled = true;
            this.GUI_Garage.element.opacity = 1;        
            this.GUI_main.element.opacity = 1;
            this.GUI_DER.enabled = true;
            this.GUI_IZQ.enabled = true;               
            this.selectAuto(autoElegido);
            
        }.bind(this));
        
};
Menu.prototype.clickLado = function(lado)
{
    if(this.tweenPlataforma != null && this.tweenPlataforma.playing)
        return;
    
    this.setMainGUI(true,this.enGarage);
    this.GUI_DER.enabled = false;
    this.GUI_IZQ.enabled = false;
    this.GUI_GO.element.opacity = 0.5;
    this.GUI_Garage.element.opacity = 0.5;   
    this.GUI_main.element.opacity = 0.5;
    
    playSound('click');
    this.indexPlataforma = this.indexPlataforma + lado;
    
    if(this.indexPlataforma == totalAutos)
    {
        this.indexPlataforma = 0;
    }
    else if(this.indexPlataforma == -1)
    {
        this.indexPlataforma = totalAutos - 1;
    }
    this.ladoAux = autoElegido;
    autoElegido = this.indexPlataforma;
    this.setPlataforma();
    var color = colorElegido[autoElegido];
    this.GUI_colores.children[autoElegido].children[color].children[2].enabled = true; 
    for(var i = 0; i < this.GUI_bolas.children.length-1; i++)  
       this.GUI_bolas.children[i].children[0].enabled = false;
    this.GUI_bolas.children[autoElegido].children[0].enabled = true;
    
    guardaAllVars();
    
};
Menu.prototype.poneEventosMain = function()
{
 
  addEventFunction(this.GUI_GO,true,1,this.clickGO.bind(this));    
  addEventFunction(this.GUI_Garage,true,1,this.clickGarage.bind(this));  
  addEventFunction(this.GUI_main,true,1,this.clickMain.bind(this,false));  
      
  for(var i = 0; i < this.GUI_bolas.children.length-1; i++)  
      this.GUI_bolas.children[i].children[0].enabled = false;
  
  this.GUI_bolas.children[autoElegido].children[0].enabled = true;
    
  for(var i = 0;i < this.GUI_colores.children.length-1;i++)
  {      
     for(var j = 0; j < this.GUI_colores.children[i].children.length-1 - 4;j++)          
        addEventFunction(this.GUI_colores.children[i].children[j],true,1,this.clickColor.bind(this,i,j));            
  }
  for(var i = 0;i < this.GUI_GarageBars.children.length-1;i++)
  {        
      var barra = this.GUI_GarageBars.children[i];   
      addEventFunction(barra.findByName("comprar"),true,1,this.clickUpgrade.bind(this,i));
  }
  

    
  var color = colorElegido[autoElegido];
  this.GUI_colores.children[autoElegido].children[color].children[2].enabled = true; 
  
  addEventFunction(this.GUI_IZQ,true,1,this.clickLado.bind(this,-1));
  addEventFunction(this.GUI_DER,true,1,this.clickLado.bind(this,1));     
 
};
