Menu.prototype.poneTutorial = function(desde)
{
    var cerrar = this.GUI_tutorialUp.findByName("cerrar");  
    var flechaIzq = this.GUI_tutorialCenter.findByName("GUI_mainIzq");  
    var flechaDer = this.GUI_tutorialCenter.findByName("GUI_mainDer");  
    
    var botonGO = this.GUI_tutorialDown.findByName("GUI_mainGO");  
    var puntos = this.GUI_tutorialDown.findByName("bolas");  
    
    botonGO.enabled = false;
    cerrar.enabled = false;
    this.GUI_tutorialCenter.enabled = true;
    this.GUI_tutorialUp.enabled = true;
    this.GUI_tutorialDown.enabled = true;
    
    flechaIzq.enabled = false;
    flechaDer.enabled = true;
    var indexFlechaTuto = 0;
    
    if(desde == "main")
        this.GUI_camaraGarage.enabled = false;
    else
    {
        cerrar.enabled = true;
        _autoControl.camara.enabled = false;
    }
    
    this.GUI_tutorial3D.enabled = true;
    var animNum = this.getAnimTuto(0);
    reproduceAnim(this.GUI_tutorial3D.children[0],animNum,1,false,null,true);
    
    for(var i = 0; i < puntos.children.length-1;i++)
        puntos.children[i].children[0].enabled = false;
    
    puntos.children[0].children[0].enabled = true;
    
    addEventFunction(flechaIzq,true,1,function(){
        playSound('click');
        indexFlechaTuto = indexFlechaTuto - 1;
        if(indexFlechaTuto < 0)
            indexFlechaTuto = 0;
        
        var animNum = this.getAnimTuto(indexFlechaTuto);
        
         reproduceAnim(this.GUI_tutorial3D.children[0],animNum,1,false,null,true);
        
        botonGO.enabled = false;
        
        if(indexFlechaTuto == 0)
            flechaIzq.enabled = false;
        else
            flechaIzq.enabled = true;
        
         if(indexFlechaTuto == 3)
            flechaDer.enabled = false;
        else
            flechaDer.enabled = true;
        
         for(var i = 0; i < puntos.children.length-1;i++)
            puntos.children[i].children[0].enabled = false;
    
         puntos.children[indexFlechaTuto].children[0].enabled = true;
        
    }.bind(this));
    
    addEventFunction(flechaDer,true,1,function(){
        playSound('click');
        indexFlechaTuto = indexFlechaTuto + 1;
        if(indexFlechaTuto > 3)
            indexFlechaTuto = 3;
        
         var animNum = this.getAnimTuto(indexFlechaTuto);
         reproduceAnim(this.GUI_tutorial3D.children[0],animNum,1,false,null,true);
        
        if(indexFlechaTuto == 3 && desde == "main")
            botonGO.enabled = true;
        else
            botonGO.enabled = false;    
        
         if(indexFlechaTuto == 0)
            flechaIzq.enabled = false;
        else
            flechaIzq.enabled = true;
        
        if(indexFlechaTuto == 3)
            flechaDer.enabled = false;
        else
            flechaDer.enabled = true;
        
        for(var i = 0; i < puntos.children.length-1;i++)
            puntos.children[i].children[0].enabled = false;
    
         puntos.children[indexFlechaTuto].children[0].enabled = true;
        
    }.bind(this));
    
    
    if(desde == "main")
    {    
        addEventFunction(botonGO,true,1,function(){
            addEventFunction(botonGO,false);
            addEventFunction(flechaIzq,false);
            addEventFunction(flechaDer,false);
            this.GUI_tutorialCenter.enabled = false;
            this.GUI_tutorialUp.enabled = false;
            this.GUI_tutorialDown.enabled = false;
            this.GUI_tutorial3D.enabled = false;
            this.GUI_camaraGarage.enabled = true;
            tutorialMostrado = 1;
            guardaAllVars();
            this.clickGO();
            
        }.bind(this));
    }
    else
    {
        addEventFunction(cerrar,true,1,function(){
            playSound('click');
            addEventFunction(cerrar,false);
            addEventFunction(flechaIzq,false);
            addEventFunction(flechaDer,false);
            this.GUI_tutorialCenter.enabled = false;
            this.GUI_tutorialUp.enabled = false;
            this.GUI_tutorialDown.enabled = false;
            this.GUI_tutorial3D.enabled = false;            
            this.pausePanel.enabled = true;
            _autoControl.camara.enabled = true;
            this.setGameGUI(true);
            
        }.bind(this));
    }
   
};
Menu.prototype.getAnimTuto = function(a)
{
      if(!pcControl)
            return(a);
    var anim = 0;
    switch(a)
    {
        case 0:
          if(controlDefaultType == 0)
              anim = 4;
          else
              anim = 6;
        break;
        case 1:
             if(controlDefaultType == 0)
              anim = 5;
          else
              anim = 7;
        break;
        case 2:
            anim = 2;
        break;
        case 3:
            anim = 3;
        break;
    }
    return(anim);
};
Menu.prototype.startGame = function()
{
    this.GUI_tapador.enabled = true;
    this.GUI_tapador.element.opacity = 0;
    var p = {       
       x: 0
    };
    this.app.tween(p).to({x: 1}, 0.6, pc.SineOut).on('update',function(){
        this.GUI_tapador.element.opacity = p.x;
    }.bind(this)).on('complete',function(){
        this.main3D.enabled = false;
        this.setMainGUI(false,this.enGarage);
        this.setGameGUI(false);    
        
        this.autosManager.script.autosManager.getAuto();
        this.empezarCarrera("tres");
        
        p.x = 1;
        this.app.tween(p).to({x: 0}, 0.5, pc.SineOut).on('update',function(){
             this.GUI_tapador.element.opacity = p.x;
        }.bind(this)).on('complete',function(){
            this.GUI_tapador.enabled = false;        
        }.bind(this)).start();
        
    }.bind(this)).start();
};
Menu.prototype.clickColor = function(a,c)
{
    
   if(this.tweenPlataforma != null && this.tweenPlataforma.playing)
        return;
       
    
    if(colorData[a]["color"+(c+1)].locked == 0)    
    {
        playSound('click');
        this.selectColor(a,c);
    }
    else
    {
        if(monedas >= colorData[a]["color"+(c+1)].cost)
        {
             monedas = monedas - colorData[a]["color"+(c+1)].cost;
             colorData[a]["color"+(c+1)].locked = 0;
             this.pintarMonedas();
             guardaAllVars();
             playSound('comprar'); 
             this.selectColor(a,c);            
        }
        else    
            playSound('noComprar');
    }
    
};
Menu.prototype.clickUpgrade = function(u)
{
    
   if(this.tweenPlataforma != null && this.tweenPlataforma.playing)
        return;
    
   
    var upgrade = this.getUpgrade(u);
    var barra = this.GUI_GarageBars.children[u];        
    var MAX = barra.findByName("MAX");
    
    if(MAX.enabled)
        return;
     console.log(upgradeCost[u][upgrade]);
    
    if(monedas >= upgradeCost[u][upgrade])
    {
        monedas = monedas - upgradeCost[u][upgrade];
        switch(u)
        {
            case 0:
                autosData[autoElegido].maxSpeed =  autosData[autoElegido].maxSpeed + 1;
            break;
            case 1:
                autosData[autoElegido].aceleration =  autosData[autoElegido].aceleration + 1;
            break;
            case 2:
                autosData[autoElegido].steering =  autosData[autoElegido].steering + 1;
            break;
            case 3:
                autosData[autoElegido].turbo =  autosData[autoElegido].turbo + 1;
            break;
        }
        this.pintarMonedas();
        guardaAllVars();
        playSound('comprar'); 
        this.selectAuto(autoElegido);         
    }
    else
         playSound('noComprar');        
};
Menu.prototype.selectColor = function(a,c)
{
    var auto = this.autosManager.children[autoElegido];
    auto.script.autoColorManager.setColor(c);    
    colorElegido[autoElegido] = c;
    
    for(var i = 0;i < this.GUI_colores.children.length-1;i++)
       this.GUI_colores.children[i].enabled = false;
    
    this.GUI_colores.children[a].enabled = true;
   
    for(var i = 0;i < this.GUI_colores.children[a].children.length-1-4;i++)        
      this.GUI_colores.children[a].children[i].children[2].enabled = false; 
  
    var color = colorElegido[autoElegido];   
    this.GUI_colores.children[a].children[color].children[2].enabled = true; 
    
    
    for(var i = this.GUI_colores.children[a].children.length-1-4;i < this.GUI_colores.children[a].children.length-1;i++)              
    {       
      this.GUI_colores.children[a].children[i].children[0].element.text = colorData[a]["color"+((i-4)+1)].cost;
         if( colorData[a]["color"+((i-4)+1)].locked == 0)
             this.GUI_colores.children[a].children[i].enabled = false;
    }
    
    
    guardaAllVars();  
};
Menu.prototype.selectAuto = function(a)
{    
   if(this.tweenPlataforma != null && this.tweenPlataforma.playing)
        return;
   
    var c =  colorElegido[autoElegido];
    var auto = this.autosManager.children[autoElegido];
    auto.script.autoColorManager.setColor(c);     

    if(autosData[a].locked == 0)
    {
        if(this.enGarage)
        {
            this.GUI_mainBuyCar.enabled = false;
            this.GUI_GarageBars.enabled = true;
            this.GUI_colores.enabled = true;
            this.selectColor(a,colorElegido[a]);
            this.selectParams(a);
        }
        else
        {
            this.GUI_mainBuyCar.enabled = false;
            this.GUI_GarageBars.enabled = false;
            this.GUI_colores.enabled = false;
        }
        this.GUI_GO.element.opacity = 1;       
    }
    else
    {
        this.GUI_GarageBars.enabled = false;
        this.GUI_mainBuyCar.enabled = true;
        this.GUI_colores.enabled = false;
        this.GUI_mainBuyCar.children[0].element.text = autosCost[a];
        addEventFunction(this.GUI_mainBuyCar,false);
        addEventFunction(this.GUI_mainBuyCar,true,1,this.clickComprarAuto.bind(this,a));
        
        this.GUI_GO.element.opacity = 0.5;       
    }

    
};
Menu.prototype.selectParams = function(a)
{
     for(var i = 0;i < this.GUI_GarageBars.children.length-1;i++)
     {        
          var upgrade = this.getUpgrade(i);        
          var barra = this.GUI_GarageBars.children[i];        
          barra.findByName("MAX").enabled = false;
          barra.findByName("comprar").children[0].element.text = upgradeCost[i][upgrade];
          for(var p = 0; p < upgradeMax[a][i];p++)
              barra.findByName("L"+(p+1)).enabled = false;
          var cont = 0;
          for(var p = 0; p < upgrade;p++)
          {
              barra.findByName("L"+(p+1)).enabled = true;
              cont = cont + 1;
          }
          if(cont ==  upgradeMax[a][i])
              barra.findByName("MAX").enabled = true;        
         
     }   
    
};
Menu.prototype.clickComprarAuto = function(a)
{
     if(this.tweenPlataforma != null && this.tweenPlataforma.playing)
        return;
    
    
     if(monedas >= autosCost[a])
     {
         monedas = monedas - autosCost[a];
         this.pintarMonedas();
         autosData[a].locked = 0;
         guardaAllVars();
         playSound('comprar');         
         this.selectAuto(a);
     }
     else
         playSound('noComprar');        
     
};
Menu.prototype.getUpgrade = function(u)
{
    var upgrade = 0;
    switch(u)
    {
        case 0:
            upgrade = autosData[autoElegido].maxSpeed;
            break;
        case 1:
            upgrade = autosData[autoElegido].aceleration;
            break;
        case 2:
            upgrade = autosData[autoElegido].steering;
            break;
        case 3:
            upgrade = autosData[autoElegido].turbo;
            break;
    }
    
    return(upgrade);
};
