Menu.prototype.setTurbo = function(t)
{   
    
    if(turbo == maxTurbo && t > 0)
        return;
    
    
    var iconoVacio = this.GUI_turbo.findByName("nitro").findByName("vacio");
    var iconoNormal = this.GUI_turbo.findByName("nitro").findByName("normal");
    var iconoMax = this.GUI_turbo.findByName("nitro").findByName("max");    
    var txt =  this.GUI_turbo.findByName("nitro").findByName("txt").element;
    
    var barraNormal =  this.GUI_turbo.findByName("barra");
    var barraMax =  this.GUI_turbo.findByName("barraMax"); 
    iconoVacio.enabled = false;
    iconoNormal.enabled = false;
    iconoMax.enabled = false;
    
    barraNormal.enabled = false;
    barraMax.enabled = false;
    
    var turboBarOld = turboBar;
    turboBar = turboBar + t;

    if(t != 0)
    {
        this.GUI_turboAnim.enabled = true;
        this.GUI_turboAnim.script.reproduceAnimSprite.play();      
    }
    
    if(turboBar >= 1 && t != 0)
    {
        turbo = turbo + 1;        
        if(turbo < maxTurbo)
            turboBar = 0;
        else
            turboBar = 1;  
        
        //alert("q wea entre aqui");
        barraNormal.setLocalScale(turboBarOld,1,1);
        barraMax.setLocalScale(turboBarOld,1,1);
        if(turboBarTween != null)
            turboBarTween.stop();
        turboBarTween =  barraNormal.tween(barraNormal.getLocalScale()).to(new pc.Vec3(1,1,1), 0.25, pc.SineOut).on('complete',function(){
            barraNormal.setLocalScale(turboBar,1,1);
        }.bind(this)).start();
         if(turboBarTweenMax != null)
            turboBarTweenMax.stop();
        turboBarTweenMax =  barraMax.tween(barraMax.getLocalScale()).to(new pc.Vec3(1,1,1), 0.25, pc.SineOut).on('complete',function(){
            barraMax.setLocalScale(turboBar,1,1);
        }.bind(this)).start();   
    }
    else
    {         
        
        barraNormal.setLocalScale(turboBarOld,1,1);
        barraMax.setLocalScale(turboBarOld,1,1);
        if(turboBarTween != null)
            turboBarTween.stop();
        turboBarTween =  barraNormal.tween(barraNormal.getLocalScale()).to(new pc.Vec3(turboBar,1,1), 0.25, pc.SineOut).start();
         if(turboBarTweenMax != null)
            turboBarTweenMax.stop();
        turboBarTweenMax =  barraMax.tween(barraMax.getLocalScale()).to(new pc.Vec3(turboBar,1,1), 0.25, pc.SineOut).start();   
    }   
   
    if(turbo == 0)
    {
        iconoVacio.enabled = true;
        barraNormal.enabled = true;        
    }
    else if(turbo == maxTurbo)
    {
        iconoMax.enabled = true;
        barraMax.enabled = true;
    }
    else
    {
        iconoNormal.enabled = true;
        barraNormal.enabled = true;
    }
    txt.text = ""+turbo;
    /*if(turbo == maxTurbo)
        txt.text = "MAX"*/
};
Menu.prototype.empezarCarrera = function(snd) {
    
    console.log("ENTRE AQUI MIERDAS!! ");
    pantalla = "321GO";
    playSound(snd);    
    switch(snd)
    {
        case "tres":
            this.hiloTiempo = null;  
            this.metaInicial.children[0].enabled = true;
            this.metaInicial.children[0].model.meshInstances[0].material.diffuseMapOffset = new pc.Vec2(0,0);
            this.metaInicial.children[0].model.meshInstances[0].material.emissiveMapOffset = new pc.Vec2(0,0);
            this.metaInicial.children[0].model.meshInstances[0].material.update();
            currentPorcentaje = 0;
            currentTramo = 0;            
            _tramos.init();    
            _autoControl.preparaAuto();
            currentPosition = _autoControl.entity.getPosition().clone();
            setTimeout(this.empezarCarrera.bind(this,"dos"),1000);
        break;
         case "dos":
            setTimeout(this.empezarCarrera.bind(this,"uno"),1000);
            this.metaInicial.children[0].model.meshInstances[0].material.diffuseMapOffset = new pc.Vec2(0,0.75);
            this.metaInicial.children[0].model.meshInstances[0].material.emissiveMapOffset = new pc.Vec2(0,0.75);
            this.metaInicial.children[0].model.meshInstances[0].material.update();
        break;
         case "uno":
            setTimeout(this.empezarCarrera.bind(this,"go"),1000);
            this.metaInicial.children[0].model.meshInstances[0].material.diffuseMapOffset = new pc.Vec2(0,0.5);
            this.metaInicial.children[0].model.meshInstances[0].material.emissiveMapOffset = new pc.Vec2(0,0.5);
            this.metaInicial.children[0].model.meshInstances[0].material.update();
        break;
         case "go":
            this.metaInicial.children[0].enabled = false;
            _autoControl.comienzaCarrera();
            _traficoSystem.iniciar(_tramos.pista);
            this.metaInicial.script.animaMeta.stopGO();
            this.metaInicial.script.animaMeta.playGO();
            this.poneEventosHud();
            
            vidas = totalVidas;
            
            time = totalTime;   
            var t = this.GUI_time.findByName("txt");
            t.script.parpadear.enabled = false;
            t.enabled = true;
            var color = new pc.Color();
            t.element.color = color.fromString(colorNormal);    
            
            _globalScore = 0;
            _raceScore = 0;
            turbo = initialTurbo;
            this.setGameGUI(true);
            this.setVidas(0);          
            this.setScore(0);
            this.setKM(0);
            this.setTime(0);
            this.setTurbo(0);
            clearInterval(this.hiloTiempo);
            this.hiloTiempo = setInterval(this.gameTime.bind(this),1000);    
            permitirPause = true;
            if(this.GUI_pause.enabled && !this.pausePanel.enabled)
            {
                if(pauseFlag)
                {
                    pauseFlag = false;                    
                    this.clickPause();
                }
            }
            else   
                pauseFlag = false;
            
            pantalla = "race";
            this.currentColor = "normal";
        break;            
    }
   
};

Menu.prototype.gameTime = function() 
{    
    if(_autoControl.pauseGame)
        return;
    
    if(time > 0)
    {       
        _menu.setTime(-1);        
        if(time == 9)
        {
            var t = this.GUI_time.findByName("txt");
            t.script.parpadear.enabled = true;
            playSound("pocoTiempo");
            var color = new pc.Color();
            t.element.color = color.fromString(colorParpadeo);
            this.currentColor = "parpadeo";
        }
        else if(time > 9)
        {            
            if(soundIsPlaying("pocoTiempo"))            
                stopSound("pocoTiempo");
            
            if(this.currentColor == "parpadeo")
            {
                var t = this.GUI_time.findByName("txt");
                t.script.parpadear.enabled = false;
                t.element.enabled = true;
                var color = new pc.Color();
                t.element.color = color.fromString(colorNormal);         
                this.currentColor = "normal";
            }
            
        }
    }
    else
    {
        _menu.setTime(0); 
        if(soundIsPlaying("pocoTiempo"))
        {
           stopSound("pocoTiempo");
           var t = this.GUI_time.findByName("txt");
           t.script.parpadear.enabled = false;
           t.element.enabled = true;
           var color = new pc.Color();
           t.element.color = color.fromString(colorNormal);    
        }
        if(_autoControl.speed == 0)
        {
            clearInterval(this.hiloTiempo);
            this.gameOver("timeOut");
        }
    }
};
