Menu.prototype.finEndScreen = function(total)
{
    var reward = this.endPanel_reward;
    reward.children[1].enabled = true;
    reward.children[2].enabled = true;
    var premio = this.determinaPremio(total);
    reward.children[1].element.text = premio;
    
    if(total > bestScore)
        bestScore = total;
    
    monedas = monedas + premio;
    this.pintarMonedas();
    this.pintarBestScore();
    guardaAllVars();
    
    this.endPanel_restart.enabled = true;
    this.endPanel_garage.enabled = true;
    
    playSound("premioFin");

    addEventFunction(this.endPanel_restart,true,1,function(){
        playSound("click");    
        addEventFunction(this.endPanel_restart,false);
        addEventFunction(this.endPanel_garage,false);
        _sonidos.slot("Music1").stop();
        _sonidos.slot("Music2").stop();
        _sonidos.slot("Music3").stop();
        this.startGame();
        setTimeout(function(){
            this.setEnding(false);
        }.bind(this),450);
        
    }.bind(this));
    
     addEventFunction(this.endPanel_garage,true,1,function(){
        playSound("click");           
          addEventFunction(this.endPanel_garage,false);
          addEventFunction(this.endPanel_restart,false);
          _sonidos.slot("Music1").stop();
          _sonidos.slot("Music2").stop();
          _sonidos.slot("Music3").stop();
          this.backToMain(true);
          setTimeout(function(){
            this.setEnding(false);           
        }.bind(this),450);
    }.bind(this));
    
    
    
};
Menu.prototype.determinaPremio = function(score)
{
    var x1 = 100000;
    var y1 = 700;
    
    var x2 = 0;
    var y2 = 0;
    
    var M = (y2-y1)/(x2-x1);
    var Y = M*(score-x1) + y1;
    
    console.log("el score q sque " + score);
    Y = Math.round(Y);
    return(Y);
    
    /*if(score >100000)
        return(Math.ceil(Math.random()*100) + 100);
    else if(score > 50000)
         return(Math.ceil(Math.random()*90) + 80);
    else if(score > 40000)
         return(Math.ceil(Math.random()*80) + 50);
    else if(score > 30000)
         return(Math.ceil(Math.random()*50) + 20);
    else
         return(Math.ceil(Math.random()*35) + 10);*/
};
