// camera-path.js
 var CameraPath = pc.createScript('cameraPath');
CameraPath.attributes.add("velocidad", {type: "number", title: "velocidad"});
CameraPath.attributes.add("posInicial", {type: "number"});
CameraPath.attributes.add("carroseriaArray", {type: "entity",array:true});
CameraPath.attributes.add('activo', {
    type: 'boolean',
    default: false,   
    description: 'si se movera o no el auto'
});

CameraPath.attributes.add('color', {
    type: 'number',
    enum: [
        { 'color1': 1 },
        { 'color2': 2 },
        { 'color3': 3 },
        { 'color4': 4 }
    ],
    default: 1,    
    description: 'Color del auto'
});
CameraPath.attributes.add('carril', {
    type: 'number',
    enum: [
        { 'carril1': 0 },
        { 'carril2': 1 },
        { 'carril3': 2 },
        { 'carril4': 3 },
        { 'carril5': 4 }
    ],
    default: 2,    
    description: 'Carril del auto'
});
CameraPath.attributes.add("currentTramo", {type: "number", default:0});



CameraPath.prototype.initialize = function() {
    
    _app = this.app;
    this.carroseria = null;
    this.carrilPosX = [-0.46,-0.23,0,0.23,0.46];
    
    //this.porcentaje = 0;
    //this.currentTramo = 0;
    //this.enPause = false;
    //this.start();
    
};
CameraPath.prototype.setSkin = function(c)
{
    for(var i = 0; i < this.carroseriaArray.length; i++)
        this.carroseriaArray[i].enabled = false;
    
    this.carroseria = this.carroseriaArray[c];
    this.carroseria.enabled = true;
};
CameraPath.prototype.setColor = function(c)
{
   this.carroseria.script.autoColorManager.setColorTrafico(c);
};
CameraPath.prototype.setCarril = function(c)
{
    var pos = this.carroseria.getLocalPosition();
    this.carroseria.setLocalPosition(this.carrilPosX[c],pos.y,pos.z);
    this.carroseria.enabled = false;
};
CameraPath.prototype.apagaPistas = function()
{
   for(var i = 0; i < this.pistas.children.length; i++)
       this.pistas.children[i].enabled = false;
};
CameraPath.prototype.start = function(pistas)
{  
    if(pistas != null)
        this.pistas = pistas;
    
    
    
    this.entity.enabled = true;
    this.currentTramo = 0;
    this.porcentaje = currentPorcentaje + this.posInicial;
    this.setVelocidad();
    this.setSkin(Math.floor(Math.random()*3));
    this.setColor(Math.floor(Math.random()*4));
    this.setCarril(Math.floor(Math.random()*5));
    
    
    this.createPath();
    this.entity.setPosition(this.px.value( this.porcentaje), this.py.value( this.porcentaje), this.pz.value( this.porcentaje));
    this.entity.lookAt(this.px.value(0.01), this.py.value(0.01), this.pz.value(0.01));
    this.pathListo = true;
   
};
CameraPath.prototype.reStart = function(pistas)
{ 
     if(pistas != null)
        this.pistas = pistas;

        this.entity.enabled = true;

        var azar2 = Math.floor(Math.random() * delays.length);
        var delay = delays[azar2];
        delays.splice(azar2,1);

        if(delays.length == 0)
            delays = [500,1000,2000,2500,3000,3500];    

        setTimeout(function(){
            this.reposicionar();               
        }.bind(this),delay);

};
CameraPath.prototype.setVelocidad = function()
{
    var totalPuntos = this.pistas[this.currentTramo][1].length;
    var velocidad88 = 0.055;
    
    //var velocidad = 1*0.045 / 88;
    //velocidad = velocidad * totalPuntos;  
    this.velocidad = 88 * velocidad88 / totalPuntos;
  
    
};
CameraPath.prototype.detener = function()
{  
     this.pathListo = false;
     this.carroseria.enabled = false;
};
CameraPath.prototype.reposicionar = function()
{        
    this.porcentaje = currentPorcentaje + 0.25;     
    if(this.porcentaje >= 1 || this.currentTramo == 0)
    {       
        this.porcentaje = this.porcentaje - 1; 
        if(this.currentTramo == 0)
            this.porcentaje = 0.1; 
        this.currentTramo = currentTramo;
        this.currentTramo = this.currentTramo  + 1;
        this.setVelocidad();
        this.setSkin(Math.floor(Math.random()*3));
        this.setColor(Math.floor(Math.random()*4));
        this.setCarril(Math.floor(Math.random()*5));
        this.createPath();
        this.pathListo = true;
       // console.log("auto se va adelante mio y quedo en el tramo " + this.currentTramo + "  y mi porcentaje " + this.porcentaje);
    }
    else
    {           
        this.currentTramo = currentTramo;        
        this.setVelocidad();
        this.setColor(Math.floor(Math.random()*4));
        this.setCarril(Math.floor(Math.random()*5));
        this.createPath();      
        this.pathListo = true;
        
       // console.log("auto queda en mi tramo " + this.currentTramo);
    }   
   
};
// update code called every frame
CameraPath.prototype.update = function(dt) {
       
    if(!this.pathListo)
        return;
   
    if(!this.activo)
        return;
    
    if(_autoControl.pauseGame)
        return;
    
    this.porcentaje = this.porcentaje + this.velocidad*dt;
    var percent = this.porcentaje;
  
  
    this.entity.setPosition(this.px.value(percent), this.py.value(percent), this.pz.value(percent));
    
    if(!this.carroseria.enabled)
        this.carroseria.enabled = true;
      
    var to = new pc.Vec3();
    this.carroseria.setLocalPosition(new pc.Vec3(this.carroseria.getLocalPosition().x,this.carroseria.getLocalPosition().y + 1,this.carroseria.getLocalPosition().z));
    var from = this.carroseria.getPosition().clone();
    from = to.add2(from,this.carroseria.up.scale(-0.08));
    var result = this.app.systems.rigidbody.raycastAll(from,to);
    var tocado = false;
    this.entity.lookAt(this.px.value(percent+0.01), this.py.value(percent+0.01), this.pz.value(percent+0.01));
    
    for(var i = 0; i < result.length; i++)
    {
        var hit = result[i];
        if(hit && hit.entity.name == "camino")
        {
            //console.log("colisione con el hit ",hit.point.y);          
            tocado = true;            
            var grndTilt = fromToRotation(pc.Vec3.UP, hit.normal);    
            var EulerQuat = new pc.Quat();
            var elY = this.carroseria.getEulerAngles().y;
            EulerQuat.setFromEulerAngles(0, elY, 0);
            this.entity.setRotation(EulerQuat);
            this.entity.setRotation(grndTilt.mul(this.entity.getRotation().clone()));              
            var posC = this.carroseria.getLocalPosition().clone();
            this.carroseria.setPosition(hit.point);             
            this.carroseria.setLocalPosition(posC.x,this.carroseria.getLocalPosition().y + 0.003,posC.z);
            break;            
         
        }
    }
    if(!tocado)
    {
        var posC = this.carroseria.getLocalPosition();
        this.carroseria.setLocalPosition(posC.x,0.003,posC.z);
    }
    
   
   
    
  
    ////console.kig(percent);
    if(percent >= 1)
    {
        this.porcentaje = 0;
        this.currentTramo = this.currentTramo  + 1;
        this.setVelocidad();       
        this.createPath();
        //this.entity.setPosition(this.px.value(0), this.py.value(0), this.pz.value(0));
        //this.entity.lookAt(this.px.value(percent+0.01), this.py.value(percent+0.01), this.pz.value(percent+0.01));
        this.pathListo = true;    
        this.carroseria.enabled = false;
        //console.log("me reinicie por fin de percent");
    }
    else if(currentTramo == this.currentTramo && percent >= currentPorcentaje + 0.99)
    {       
        this.porcentaje = currentPorcentaje + 0.3;      
        this.setVelocidad();
        this.setColor(Math.floor(Math.random()*4));
        this.setCarril(Math.floor(Math.random()*5));
        this.createPath();
        this.pathListo = true;
        //console.log("me reinicie por  tramos iguales");
    }
    else if(currentTramo < this.currentTramo && percent + 1 >= currentPorcentaje + 0.99)
    {
      // console.kig("auto va tramo adelantado");
        if(currentPorcentaje + 0.4 >= 1)
        {
            this.porcentaje = currentPorcentaje + 0.4 - 1;            
            this.setVelocidad();
            this.setColor(Math.floor(Math.random()*4));
            this.setCarril(Math.floor(Math.random()*5));
            this.createPath();
            this.pathListo = true;
           // console.log("auto queda en tramo adelantado");
            
        }
        else
        {
            this.porcentaje = currentPorcentaje + 0.4;            
            this.currentTramo = this.currentTramo  - 1;
            this.setVelocidad();
            this.setColor(Math.floor(Math.random()*4));
            this.setCarril(Math.floor(Math.random()*5));
            this.createPath();            
            this.pathListo = true;
            //console.log("auto retrocede un tramo");
        }
    }
  
};


CameraPath.prototype.createPath = function () {
    this.pathListo = false;
    var curveMode = pc.CURVE_CARDINAL;
    
    // Create curves for position
    this.px = new pc.Curve(); 
    this.px.type = curveMode;
    
    this.py = new pc.Curve(); 
    this.py.type = curveMode;    
    
    this.pz = new pc.Curve(); 
    this.pz.type = curveMode;
    
    // Create curves for target look at position
    this.tx = new pc.Curve();
    this.tx.type = curveMode;
    
    this.ty = new pc.Curve();
    this.ty.type = curveMode;
    
    this.tz = new pc.Curve();
    this.tz.type = curveMode;
    
    // Create curves for the 'up' vector for use with the lookAt function to 
    // allow for roll and avoid gimbal lock
    this.ux = new pc.Curve();
    this.ux.type = curveMode;
    
    this.uy = new pc.Curve();
    this.uy.type = curveMode;
    
    this.uz = new pc.Curve();
    this.uz.type = curveMode;
    
    ////console.kig(this.pistas);
    var level = this.pistas[this.currentTramo][0];
    var levelPuntos =  this.pistas[this.currentTramo][1]; 
   
    var puntoFinal = new pc.Vec3();   
   /* var bajada = 0;
    var extraY = -0.19;
    if(arrayLevels.length == 0)
        puntoFinal = new pc.Vec3(0,0,0);
    else
    {
        var levelAnterior = arrayLevels[currentLevelCont-1][1];
        var mcLvlPos = arrayLevels[currentLevelCont-1][0];        
        puntoFinal = new pc.Vec3(mcLvlPos.x + levelAnterior[levelAnterior.length -1].x ,mcLvlPos.y + levelAnterior[levelAnterior.length -1].y,mcLvlPos.z + levelAnterior[levelAnterior.length -1].z);       
        bajada = this.bajadaEntrePistas;
    }   
    level.setPosition(puntoFinal.x,puntoFinal.y - bajada,puntoFinal.z + this.distanciaEntrePistas);   
    arrayLevels.push([level.getPosition().clone(),levelPuntos]);*/
    
    var posLevel = level.getPosition();
    
   
    var pathLength = 0;
    
    // Store the distance from the start of the path for each path node
    var nodePathLength = [];
    
    // For use when calculating the distance between two nodes on the path
    var distanceBetween = new pc.Vec3();
    
    // Push 0 as we are starting our loop from 1 for ease
    nodePathLength.push(0);
   
    var k = 1;
    for (i = 2; i < levelPuntos.length; i++) {
        
        var prevNode = new pc.Vec3();
        var realLevelPointAnterior = new pc.Vec3(levelPuntos[i-1].x*-1,levelPuntos[i-1].y,levelPuntos[i-1].z);
        prevNode.add2(posLevel,realLevelPointAnterior);
        var nextNode = new pc.Vec3();
       
        var realLevelPoint = new pc.Vec3(levelPuntos[i].x*-1,levelPuntos[i].y ,levelPuntos[i].z);
        nextNode.add2(posLevel,realLevelPoint);
        
        // Work out the distance between the current node and the one before in the path
        distanceBetween.sub2(prevNode, nextNode);
        pathLength += distanceBetween.length();        
        nodePathLength.push(pathLength);       
     
    }
   
    var angulos = window["pista"+this.currentTramo + "Spline_angulos"];
  
    for (i = 1; i < levelPuntos.length; i++) {
        // Calculate the time for the curve key based on the distance of the path to the node
        // and the total path length so the speed of the camera travel stays relatively
        // consistent throughout
        
        var t = nodePathLength[i-1] / pathLength;
        var node = new pc.Vec3();
       
         var realLevelPoint = new pc.Vec3(levelPuntos[i].x*-1,levelPuntos[i].y,levelPuntos[i].z);
        
        node.add2(posLevel,realLevelPoint);
        
        var pos = node;
       
        this.px.add(t, pos.x);
        this.py.add(t, pos.y);
        this.pz.add(t, pos.z);       
    }
    //this.porcentaje = 0;
   
};
CameraPath.prototype.stop = function()
{  
      
    this.entity.enabled = false;
    this.currentTramo = 0;   
    this.pathListo = false;
   
};


