// checkPoint.js
var CheckPoint = pc.createScript('checkPoint');
CheckPoint.attributes.add('tiempo', {type: 'number', default:30});

// initialize code called once per entity
CheckPoint.prototype.initialize = function() {
    
      this.entity.collision.on('triggerenter', this.onTriggerEnter, this);
      this.activado = false;
};

CheckPoint.prototype.onTriggerEnter = function(entity)
{
    if(entity.name == "carroceria" && !this.activado)
    {
        //checkPoint;
        
        this.activado = true;
        setTimeout(function(){
            this.activado = false;
        }.bind(this),4000);
        
        playSound("checkPoint");
        _menu.poneMSG("checkPoint");
       
        _raceScore = _raceScore + time*50;
        _menu.pintarScore(_raceScore);
        time = time + this.tiempo;        
        currentCheckpoint = currentCheckpoint + 1;   
        checkPointCant = checkPointCant + 1;
        if(checkPointCant % 3 == 0)
        {
            console.log("EXCEPCION!! REGALMOS 10 SEGUNDOS MAS");
            time = time + 10;
        }
        
        _globalScore = _globalScore + distanceScore;
        distanceScore = 0;
        //console.log("el currentCheckpoint " +currentCheckpoint );
        //console.log(_tramos.checkPoints);
        distanciaCheckIni = _tramos.checkPoints[currentCheckpoint].getPosition().clone().distance(this.entity.getPosition().clone());
        _menu.GUI_check.findByName("barra").setLocalScale(0,1,1);     
        _menu.GUI_checkAnim.enabled = true;
         _menu.GUI_check.findByName("icon").enabled = false;
        _menu.GUI_checkAnim.script.reproduceAnimSprite.play(function(){
             _menu.GUI_check.findByName("icon").enabled = true;            
        }.bind(this));
       
    }
    
};



