var AnimaMeta = pc.createScript('animaMeta');
AnimaMeta.attributes.add('material', { type: 'asset', assetType: 'material', array: false });
// initialize code called once per entity
AnimaMeta.prototype.initialize = function() {
    this.anim1 = null;
    this.anim2 = null;
 
};

AnimaMeta.prototype.animGO = function() {
        
     this.material.resource.opacityMapOffset = new pc.Vec2(0,0.25);
     this.material.resource.diffuseMapOffset = new pc.Vec2(0,0.25);
     this.material.resource.emissiveMapOffset = new pc.Vec2(0,0.25);    
    
     this.material.resource.update();
    
};

AnimaMeta.prototype.animGO2 = function() {
        
     this.material.resource.opacityMapOffset = new pc.Vec2(0,0.5);
     this.material.resource.diffuseMapOffset = new pc.Vec2(0,0.5);
     this.material.resource.emissiveMapOffset = new pc.Vec2(0,0.5);   
    
    this.material.resource.update();
    
};

AnimaMeta.prototype.playGO = function() {
        
    this.animGO();
    this.anim1 = setTimeout(function(){
        this.animGO2();
        this.anim2 = setTimeout(function(){
            this.playGO();
        }.bind(this),220);
    }.bind(this),220);    
    
};
AnimaMeta.prototype.stopGO = function() {
        
    clearTimeout(this.anim1);
    clearTimeout(this.anim2);
    
};

