var TramosManager = pc.createScript('tramosManager');
TramosManager.attributes.add('triggerSCript', {type:'asset'});
TramosManager.attributes.add('tramos_iniciales', {type: 'entity'});
TramosManager.attributes.add('tramos_tunel', {type: 'entity'});
TramosManager.attributes.add('tramos_playa', {type: 'entity'});
TramosManager.attributes.add('tramos_ciudad', {type: 'entity'});
TramosManager.attributes.add('tramos_desierto', {type: 'entity'});
TramosManager.attributes.add('tramos_por_tematica', {type: 'number',default:3});

// initialize code called once per entity
TramosManager.prototype.initialize = function() {
    
     this.app.assets.load(this.triggerSCript);
     this.pista = null;
     this.checkPoints = [];
    _tramos = this;
    
    
};

TramosManager.prototype.init = function() 
{
    
    currentTematica = "playa";
    tramoInicialTematica = null;
    
    for(var i = 0; i < this.tramos_playa.children.length;i++)
         this.tramos_playa.children[i].enabled = false;
    
    for(var i = 0; i < this.tramos_ciudad.children.length;i++)
         this.tramos_ciudad.children[i].enabled = false;
    
    for(var i = 0; i < this.tramos_iniciales.children.length;i++)
         this.tramos_iniciales.children[i].enabled = false;
    
    for(var i = 0; i < this.tramos_tunel.children.length;i++)
         this.tramos_tunel.children[i].enabled = false;
   
    this.checkPoints = [];
    this.tramoPartida = [];
    
    this.tramoPartida[0] = this.tramos_iniciales.children[0];   
    this.tramoPartida[1] = pista_inicial0Spline;
    this.tramoPartida[2] = pista_inicial0Spline_angulos;
    this.tramoPartida[3] = false;
    
    
    
    this.pista = [];
    this.pista.push(this.tramoPartida);
   
    this.addTematica("playa");
    this.addTematica("ciudad");
    this.addTematica("desierto");
   
          
    this.pista[0][0].enabled = true;
    for(var i = 0; i< this.pista.length-1; i++)
    {
        var puntos = this.pista[i][1];
        var tramoNext = this.pista[i+1][0];
        var tramo = this.pista[i][0];               
        tramo.enabled = true;
        var pos = tramo.getPosition();
        //console.log(i);
        var puntoFinal = new pc.Vec3(pos.x - puntos[puntos.length-2].x,pos.y + puntos[puntos.length-2].y,pos.z + puntos[puntos.length-2].z);
        
        tramoNext.setPosition(puntoFinal);
        tramoNext.enabled = true;        
        console.log(tramoNext.name);
        console.log(tramoNext.enabled);
    }
    
    this.setTriggersPista();
    for(var i = 2; i< this.pista.length; i++)
    {       
        var tramo = this.pista[i][0];
        setTimeout(this.apagaTramo.bind(this,tramo),60);       
    }
        
};
TramosManager.prototype.apagaTramo = function(tramo)
{           
    /*if(tramo.name.includes("tunel"))
    {
        console.log("excepcion, no apagar tunel fix de mrd... " + tramo.name);
        return;
    }*/
    
    tramo.enabled = false;
    console.log("apagando el tramo " + tramo.name);

};
TramosManager.prototype.nuevaTematica = function(tematica)
{
    console.log("CREANDO NUEVA TEMATICA");
    var indexInit = this.pista.length-1;
    this.addTematica(tematica); 
    for(var i = indexInit; i< this.pista.length-1; i++)
    {
        var puntos = this.pista[i][1];
        var tramoNext = this.pista[i+1][0];
        var tramo = this.pista[i][0];               
        tramo.enabled = true;
        var pos = tramo.getPosition();
        var puntoFinal = new pc.Vec3(pos.x - puntos[puntos.length-2].x,pos.y + puntos[puntos.length-2].y,pos.z + puntos[puntos.length-2].z);
        
        tramoNext.setPosition(puntoFinal);
        tramoNext.enabled = true;        
    }
    
    this.setTriggersPista();
    for(var i = indexInit + 1; i< this.pista.length; i++)
    {       
        var tramo = this.pista[i][0];
        setTimeout(this.apagaTramo.bind(this,tramo),60);       
    }   
};

TramosManager.prototype.addTematica = function(tematica)
{
    var randomTramos = [];    
    for(var i = 0; i < this["tramos_"+tematica].children.length;i++)
        randomTramos.push(i);
  
    //var test = [4,3,2];
    for(var i = 0; i < this.tramos_por_tematica;i++)
    {
        var azar =  Math.floor(Math.random() * randomTramos.length);
        var index = randomTramos[azar];
        var tramo = this["tramos_"+tematica].children[index];
        var puntos = window["pista"+index+"Spline_"+tematica];
        var angulos = window["pista"+index+"Spline_"+tematica+"_"+angulos];
        this.checkPoints.push(tramo.findByName("checkPoint"));
        console.log("tramo q agregamos es  " + tramo.name);
        this.pista.push([tramo,puntos,angulos]);
        randomTramos.splice(azar,1);                      
    }
    
    this.tramoTunel = [];    
    this.tramoTunel[0] = this.tramos_tunel.findByName("tramo-tunelfinal_"+tematica);
    this.tramoTunel[1] = window["pista0_tunelSpline_"+tematica];
    this.tramoTunel[2] = window["pista0_tunelSpline_"+tematica+"_angulos"];
    this.tramoTunel[3] = false;
     console.log("tramo q agregamos es  " + this.tramoTunel[0].name);
    this.pista.push(this.tramoTunel);
      
};
// update code called every frame
TramosManager.prototype.setTriggersPista = function() 
{
    var cont = 0;    
    for(var i = 0; i< this.pista.length; i++)
    {         
        for(var p =0; p < this.pista[i][1].length-1; p++)
        {
            if(p % 2 != 0)
            {
                var entity = null;
                if(this.pista[i][0].findByName("punto_"+p) == null)
                {
                    entity = new pc.Entity();
                    entity.name = "punto_"+p;
                    this.pista[i][0].addChild(entity);
                    //console.log("agregando puntos a la pista " + this.pista[i][0].name);
                    //console.log(this.pista[i][1][p]);
                    entity.setLocalPosition(new pc.Vec3(-this.pista[i][1][p].x,this.pista[i][1][p].y-0.5,this.pista[i][1][p].z));
                    entity.setLocalEulerAngles(0,0,0);
                    entity.lookAt(new pc.Vec3(-this.pista[i][1][p+1].x,this.pista[i][1][p+1].y-0.1,this.pista[i][1][p+1].z));
                    entity.setLocalEulerAngles(0,entity.getLocalEulerAngles().y,0);       
                   /* entity.addComponent("model", {
                        type: 'box',
                    });*/
                    entity.addComponent("collision", {
                        type: 'box',
                        halfExtents:new pc.Vec3(2.5,0.2,0.2)
                    });
                    entity.addComponent('script');
                    entity.script.create('triggerPuntos');                      
                    //entity.setLocalScale(2.5,0.2,0.2);                    
                }
                else
                    entity = this.pista[i][0].findByName("punto_"+p);
                
                entity.script.triggerPuntos.punto = cont;
                cont = cont + 1;

                entity.script.triggerPuntos.puntosTotales = this.pista[i][1].length;
                entity.script.triggerPuntos.currentPunto = p;
                entity.script.triggerPuntos.tramo = i;

                if(this.pista[i][0].name == "tramo-tunelfinal_playa")
                {
                    if(p == 45 || p == 47 || p == 49 || p == 51)
                    {
                        entity.script.triggerPuntos.cambioDomo = true;      
                    }
                    else if(p == 111 || p == 113 || p == 115 || p == 117)
                    {
                        
                        entity.script.triggerPuntos.nuevaMusica = true;                        
                    }
                }
                else  if(this.pista[i][0].name == "tramo-tunelfinal_ciudad")
                {
                    if(p == 27 || p == 29 || p == 31 || p == 33)
                    {
                        entity.script.triggerPuntos.cambioDomo = true;      
                    }
                    else if(p == 91 || p == 93 || p == 95 || p == 97)
                    {
                        entity.script.triggerPuntos.nuevaMusica = true;                        
                    }
                }
                else  if(this.pista[i][0].name == "tramo-tunelfinal_desierto")
                {
                    if(p == 27 || p == 29 || p == 31 || p == 33)
                    {
                        entity.script.triggerPuntos.cambioDomo = true;      
                    }
                    else if(p == 111 || p == 113 || p == 115 || p == 117)
                    {
                        entity.script.triggerPuntos.nuevaMusica = true;                        
                    }
                }


            }
        }     
        
    }
};


