// tweenCamara.js
var TweenCamara = pc.createScript('tweenCamara');

// initialize code called once per entity
TweenCamara.prototype.initialize = function() {
  //this.rotaCamara(1.2);
  //this.mueveCamara(-0.08);
  this.inicioD = this.entity.getLocalPosition().clone();
  this.destinoD = new pc.Vec3(0.02,0.499,0.194);
    
  this.inicioR = this.entity.getLocalEulerAngles().clone();
  this.destinoR = new pc.Vec3(-14.44,0,0);
    
  this.inicioF = 45;
  this.destinoF = 49;
    
  
};
TweenCamara.prototype.rotaCamara = function(ang) {
     this.entity.tween(this.entity.getLocalEulerAngles()).rotate(new pc.Vec3(-2.9, ang, 0),8,pc.SineInOut).on('complete', this.rotaCamara.bind(this,ang*-1)).start();
};
TweenCamara.prototype.mueveCamara = function(mov) {
     var pos = this.entity.getLocalPosition().clone();
     this.entity.tween(this.entity.getLocalPosition()).to(new pc.Vec3(pos.x, pos.y, pos.z + mov),6,pc.SineInOut).on('complete', this.mueveCamara.bind(this,mov*-1)).start();
};

TweenCamara.prototype.animMainToGarage = function() {
    
    this.entity.tween(this.entity.getLocalEulerAngles()).rotate(this.destinoR,0.5,pc.SineInOut).start();
    this.entity.tween(this.entity.getLocalPosition()).to(this.destinoD,0.5,pc.SineInOut).start();
    
    var p = {       
          x:45
     };
   
    this.app.tween(p).to({x: 49},0.5, pc.SineOut).on('update', function() {
                   this.entity.camera.fov = p.x;                 
              }.bind(this)).start();
    
    
};
TweenCamara.prototype.animGarageToMain = function() {
    
    this.entity.tween(this.entity.getLocalEulerAngles()).rotate(this.inicioR,0.5,pc.SineInOut).start();
    this.entity.tween(this.entity.getLocalPosition()).to(this.inicioD,0.5,pc.SineInOut).start();
    
    var p = {       
          x:49
     };
   
    this.app.tween(p).to({x: 45},0.5, pc.SineOut).on('update', function() {
                   this.entity.camera.fov = p.x;                 
              }.bind(this)).start();
    
};

