// reproduceAnimSprite.js
var ReproduceAnimSprite = pc.createScript('reproduceAnimSprite');
ReproduceAnimSprite.attributes.add("frames", {type: "number", title: "frames"});
ReproduceAnimSprite.attributes.add("spriteNumber", {type: "number", title: "spriteNumber"});
ReproduceAnimSprite.attributes.add("loop", {type: "boolean", title: "loop"});
ReproduceAnimSprite.attributes.add("desde", {type: "number", title: "desde"});
ReproduceAnimSprite.attributes.add("hasta", {type: "number", title: "hasta"});
ReproduceAnimSprite.attributes.add("autoStart", {type: "boolean", title: "autoStart"});
ReproduceAnimSprite.attributes.add("hideOnFinish", {type: "boolean", title: "hideOnFinish"});


// initialize code called once per entity
ReproduceAnimSprite.prototype.initialize = function() {
    
  this.index = this.desde;
  this.cont = 0;
  this.callBack = null;
          
};

ReproduceAnimSprite.prototype.play = function(callBack,desde,hasta)
{
    this.cont = 0;
    this.desde = desde;    
    if(desde == null)
        this.desde = 0;
    this.hasta = hasta;
    if(hasta == null)
        this.hasta = this.spriteNumber;
    this.index =  this.desde;
    this.callBack = callBack;
    this.autoStart = true;
};

// update code called every frame
ReproduceAnimSprite.prototype.update = function(dt) {
      
    if(!this.autoStart)
        return;
    
    
    var tiempo = dt;
    var fps = 1/tiempo;
    this.cont = this.cont + tiempo;    
    var frameLimite = fps / this.frames;
    frameLimite = frameLimite / fps;
    
    if (this.cont >= frameLimite)
    {
       // console.log(this.index);
        this.cont = 0;
        this.entity.element.spriteFrame = this.index;
        this.index = this.index + 1;
        if(this.index == this.hasta)
        {
            if(this.loop)
                this.index = 0;
            else
            {
                this.autoStart = false;
                if(this.callBack != null)
                    this.callBack();
                if(this.hideOnFinish)
                    this.entity.enabled = false;               
            }
        }        
    }
        
};



// ammo-ccd.js
var AmmoCcd = pc.createScript('ammoCcd');

AmmoCcd.attributes.add('motionThreshold', {
    type: 'number', 
    default: 1, 
    title: 'Motion Threshold', 
    description: 'Number of meters moved in one frame before CCD is enabled'
});

AmmoCcd.attributes.add('sweptSphereRadius', {
    type: 'number', 
    default: 0.2, 
    title: 'Swept Sphere Radius', 
    description: 'This should be below the half extent of the collision volume. E.g For an object of dimensions 1 meter, try 0.2'
});


// initialize code called once per entity
AmmoCcd.prototype.initialize = function() {
    if (this.entity.rigidbody) {
        this.entity.rigidbody.body.setCcdMotionThreshold(this.motionThreshold);
        this.entity.rigidbody.body.setCcdSweptSphereRadius(this.sweptSphereRadius);
    }
};

