Fps.prototype.initialize = function() {
    fps = this;
    this.fps = new FPSMeter();
    this.hilo = null;
    this.fpsProm = 0;   
    this.benchHecho = false;
};

Fps.prototype.update = function() {
    this.fps.tick();
    //console.log(this.fps.getFPS());
};
Fps.prototype.getFPS = function() {
   
    return(this.fps.getFPS());
};
Fps.prototype.bench = function() 
{     
    if(this.benchHecho)
        return;
    
    this.hilo = setInterval(this.calcularFPSpromedio.bind(this,1),500);
};
Fps.prototype.calcularFPSpromedio = function(intento)
{
    this.fpsProm = this.fpsProm + this.getFPS();
    //console.log("fps en este frame " + this.getFPS());
    clearInterval(this.hilo);       
    if(intento == 6)     
    {
       this.fpsProm = this.fpsProm/intento;
       this.setCalidad();
    }
    else
        this.hilo = setInterval(this.calcularFPSpromedio.bind(this,intento+1),500);
        
};
Fps.prototype.setCalidad = function() 
{
    console.log("los fps promedios fueron de " + this.fpsProm);
    if(this.fpsProm >= 50)
    {
         this.app.graphicsDevice.maxPixelRatio = window.devicePixelRatio;
        console.log("la calidad elegida fue MAXIMA");
    }
    else if(this.fpsProm >= 40)
    {
         var num = window.devicePixelRatio*0.70;
         if(num < 1)
             num = 1;
         this.app.graphicsDevice.maxPixelRatio = num;
         console.log("la calidad elegida fue media alta");
    }
    else if(this.fpsProm >= 25)
    {
         var num =  window.devicePixelRatio*0.5;
         if(num < 1)
             num = 1;
         this.app.graphicsDevice.maxPixelRatio = num;
         console.log("la calidad elegida fue media ");
    }
    else 
    {
        this.app.graphicsDevice.maxPixelRatio = 1;
        console.log("la calidad elegida fue baja");
    }
    this.benchHecho = true;       
    
    
};

